    content:
      '<p><strong>Assessing the impact of banning the single-use plastic carrier bags: A case study for Kenyan marine environment looking at macro, meso and microplastics </strong></p><p>Charles Mitto Kosore<sup>a*</sup>, Edward Waiyaki<sup>b </sup>and Faith Kimanga<sup>c</sup></p><p><sup>a</sup>Kenya Marine and Fisheries Research Institute, Mombasa, Kenya, P.O. Box 81651-80100, Directorate of Ocean and Coastal Systems and Blue Economy, Department of Oceanography and Hydrography, Mombasa, Kenya</p><p><sup>bc</sup>Kenya Marine and Fisheries Research Institute, Mombasa, Kenya, P.O. Box 81651-80100, Directorate of Socio-Economics, Mombasa, Kenya</p><p><strong><em><sup>*</sup></em></strong><em>Corresponding Author: </em><a href="mailto:cmitto@kmfri.go.ke"><em>cmitto@kmfri.go.ke</em></a><em> ; </em><a href="mailto:ckosore@gmail.com"><em>ckosore@gmail.com</em></a></p><p><strong>Abstract</strong></p><p>Poor waste management and unsustainable institutional and individual behaviors have led to the accumulation of plastic litter in many habitats worldwide. An assessment of plastic pollution in the Kenyan marine environment was conducted focusing on the impact of banning single-use plastic carrier bags in Kenya. The quantification, composition, and distribution of plastics were determined at nine (9) beaches along the Kenyan coastline using the standing stock method. Plastic polymers were identified using Attenuated Total Reflectance – Fourier Transform Infrared spectrometer (ATR-FTIR). A total of 750 plastic items were collected and categorized with only 47 pieces being single-use plastic carrier bags. A great number of plastics (n = 383), were identified by their original use, with packaging plastics being the most common (n = 155). Macroplastics were the overall dominant plastics at 76%, mesoplastics, at 21%, and microplastics, at 3%, which were altogether dominated by Low-density polyethylene (LDPE) at (46%), followed by polypropylene (PP), at 30%, polyethylene terephthalate (PET), 9%,  polyvinyl chloride (PVC), 8% and polystyrene (PS), 7%. The absence of identifiable single-use plastic carrier bags in 6 out of 9 beaches signified the effectiveness of the ban in Kenya. Monitoring of trends and sources of plastic debris is encouraged to help improve the science-policy linkage aimed at reducing marine plastic pollution to increase biodiversity conservation for a sustainable blue economy in Kenya.</p><p><strong>Key words: </strong>Plastic bags ban; single use plastic carrier bags; monitoring; marine environment; blue economy; Kenya</p>',
