    path: 'dox/Blue Economy Policies and Governance/POSTER/levels of heavy metals in the straightfin barb enteromius paludinosus _peters 1852_ from river malew.pdf',
    content:
      '<p><strong>Levels of heavy metals in the straightfin barb Enteromius paludinosus (Peters 1852) from River Malewa, Naivasha, Kenya</strong></p><p><strong>Elizabeth Adhiambo Ngesa, Elick Onyango Otachi, Nzula Kivuva Kitaka</strong></p><p><strong>Egerton University</strong></p><p>There have been several studies on heavy metals in Lake Naivasha. However, none of them has reported the levels of mercury (Hg), arsenic (As), and chromium (Cr). Furthermore no research has been conducted on heavy metals concentrations in the straightfin barb (<em>Enteromius paludinosus</em>, Peters 1852), a fish species that hosts the parasite <em>Ligula intestinalis</em>, the latter having been reported to have high ability to absorb heavy metals from its host. My study therefore addressed the accumulation of heavy metals, namely arsenic, chromium, lead, and mercury in the tissues of straightfin barb from the mouth of River Malewa in Lake Naivasha, Kenya. 1307 fish were sampled. Water samples, sediment samples, 25 fish muscle tissues, and its endoparasite, <em>Ligula intestinalis</em>, were isolated, and heavy metal concentrations determined using the thermal-electron atomic absorption spectrophotometer at the Lake Nakuru Water Quality Testing Laboratory. Concentrations of heavy metals in the sediment were below the lowest effect level in sediment, threshold effect concentration in sediment, severe effect concentration in sediment, and shale values of sedimentary rocks indicating no sign of pollution. In muscle tissues of the fish, As, Cr, Pb, and Hg showed high levels with mean concentrations of 5.0696, 22.0854, 45.2108, and 1.5458 mg/kg ww, respectively. Bioconcentration factors further supported the observation that trace element accumulation was higher in fish compared with sediment and water. Target hazard quotients of As, Cr, Pb, and Hg obtained for both the female and male were &gt; 1 indicating a possible health risk associated with consumption of <em>E. paludinosus</em>. The bioaccumulation factors for <em>L. intestinalis</em> were 2.4093, 2.1873, 5.8601, and 5.1395 for As, Cr, Pb, and Hg, respectively, indicating the potential of the cestode in the accumulation of heavy metals from the host; hence, it can be used as an accumulation bioindicator. </p>',
