    content:
      '<p><strong>THE NEED TO SUPPLEMENT CURRENT INPUT CONTROLS WITH OUTPUT CONTROLS IN COMMERCIAL FISHERIES MANAGEMENT OF LAKE MALAWI</strong></p><p><strong>M. Mulumpwa<sup>1,2</sup>, E. Kaunda<sup>2</sup>, M. Hara<sup>3</sup> and W. Jere<sup>2</sup></strong></p><p>Senga Bay Capture Fisheries Research Unit, P.O. Box 316, Salima, Malawi<strong><sup>1</sup></strong>.</p><p>Lilongwe University of Agriculture and Natural Resources, Bunda Campus, P.O. Box 219, Lilongwe. Malawi<strong><sup>2</sup></strong>.</p><p>The University of the Western Cape, Institute for Poverty, Land and Agrarian Studies (PLAAS), Private Bag X17, Bellville, 7535<strong><sup>3</sup></strong>.</p><p><strong>Corresponding author:</strong> <a href="mailto:mulumpwa.mexford@gmail.com">mulumpwa.mexford@gmail.com</a></p><p><strong>Abstract</strong></p><p>All fisheries regulations employed in Malawi regarding control of fisheries effort are input-control measures. This study was conducted among commercial fishers to assess catch composition and catch per unit effort (CPUE). Secondary time-series catch data (1976 to 2022) obtained from Department of Fisheries was used.</p><p>Estimation of MSY and optimum fishing effort at MSY of largescale fisheries in Malawi using linear Schaefer model showed that catch MSY was 266.96 tons/year and fmsy was 1953 fishing days. Trend of observed catch and CPUE were declining over the years. Mean catches in 76 years, recent 10- and 5-years period was 1702.5%, 824.5% and 699% of calculated MSY (266.96 tons) respectively. Mean fishing effort in the same period was 246.1%, 136.3% and 136% of calculated fmsy (1952.86 fishing days). Largescale fishers are extensively fishing beyond MSY and Fmsy which is very worrisome.</p><p>Overexploitation of largescale fisheries resources beyond MSY and fmsy could as be as a result of increase in fishing effort by 436% between 1976 and 2022.  This is a huge increase in a fisheries resources understanding that size Lake Malawi largescale fisheries resources are still limited and requires efficient management strategies in place. To ensure that largescale fisheries resources are not being exploited beyond MSY and that fishing effort is not beyond the fmsy, there is a need to employ output control measures. Although they are difficult to implement, high overexploitation leading to tragedy of commons necessitates their inclusion in the current fisheries management system in Malawi. </p><p>                                          </p><p><strong>Keywords</strong>: trawl fishery, largescale fishery, food security, fisheries management, Lake Malawi.</p>',
