    content:
      '<p><a id="_Hlk151975914"></a><a id="_Hlk79699026"></a><strong>Harnessing the potential of local fish market actors to support nutritional security in coastal Kenya</strong></p><p>Johnstone O. Omukoto<sup> 1,2, *</sup>, Nicholas A.J Graham<sup>1</sup> and Christina C. Hicks<sup>1</sup></p><p><sup>1</sup>Lancaster Environment Centre, Lancaster University, Lancaster LA1 4YQ, United Kingdom</p><p><sup>2</sup>Ocean and Coastal Fisheries Research Department, Kenya Marine and Fisheries Research Institute, Box 81651 - 80100 Mombasa, Kenya</p><p>*Correspondence author: <a href="mailto:j.omuhaya@lancaster.ac.uk">j.omuhaya@lancaster.ac.uk</a> / <a href="mailto:jomukoto@gmail.com">jomukoto@gmail.com</a></p><p><strong>Abstract</strong></p><p><a id="_Hlk109036578"></a>Fish markets are key to supporting the availability and accessibility of nutritious food but are often overlooked in food and nutrition research and policy. This study investigated <a id="_Hlk95128193"></a>fish markets in coastal Kenya, using data from 223 semi-structured interviews collected through market surveys. The objectives of the research were to: <a id="_Hlk151625942"></a>1. Characterise the different market traders operating in coastal Kenya; 2. Establish the nutritional quality of fish sold by the different market traders; 3. Evaluate the cost of nutritious fish sold by different market traders; and 4. Determine whether traded fish has the potential to meet the fish consumption and nutrient needs of children under five in the adjacent populations. Findings reveal that women small-scale traders dealt in lower quantities of fish per trader than the other traders, yet sold more nutritious fish. Fish shop traders sold enough fish to meet 129% of the recommended intake of fish (10.4 kg cap<sup>-1</sup> yr<sup>-1</sup>) for all people within the assessed towns, whereas women small-scale traders sold enough to meet 84% of the intake. All market traders were key to making nutrient-dense fish available, with a 100 g portion of fish providing at least 25% of required intakes, across five nutrients, and women small-scale traders providing over 25% of required intakes across six nutrients for a child under five years. The average cost of a nutritious portion of fish was KES 31 (USD 0.22), ranging from KES 12 (USD 0.08) to 49 (USD (0.34), which provide 33.3% of the required nutrients (averaged across six nutrients), with nutrient-dense fish being notably cheaper. This study contributes key empirical information to fill the knowledge gap on the role of subnational fish trade in supporting nutrition and recommends<a id="_Hlk95128752"></a> the incorporation of this information to support transformative policy toward promoting nutrition-sensitive fish markets in Kenya.</p><p><strong>Keywords:</strong> Nutrient content, fish trade, nutrient adequacy, nutrient deficiencies, nutrition-sensitive trade </p>',
