    content:
      '<p><strong>A delicate balance between offshore in-land aquaculture and the environment. A focus on Lake Victoria, Kenya</strong></p><p><strong>RIO FISH LIMITED</strong></p><p><strong>Mercy Chepkirui, Angela Odero, Nivah Ondieki, Paul Orina, Tonny Sagwe</strong></p><p><strong>Abstract</strong></p><p>The decline in capture fisheries as a result of growing population and increasing awareness on nutritional benefits of white meat has led to development of aquaculture. This is anticipated to meet the increasing call for more food for human population which is likely to increase further by 2050. Aquaculture began commercializing in the 1960s resulting to the current contribution of 87.5 million tonnes. This is accredited to technological advancement from traditional culture systems to modern culture systems including cage fish farming. In Lake Victoria, Kenya cage farming started in 1988 when Lake Basin Development Authority conducted the first pilot trials at Dunga Beach but bore no fruits. Participatory approach with Kenya Marine and Fisheries Research Institute and Dunga Beach Management led to success through installation of cages at Dunga Beach in 2009. However, cage farming is likely to emit large bulk of fish waste into the ecosystem thus affecting ecological balance. Moreover, the ecological changes as a result of cage farming is expected to have an effect on the wild fisheries. Because of these fears, among other factors, there is need to enforce regulation governing cage farming in the lake to avoid further degradation of the ecosystem.</p>',
