    content:
      '<p><strong>Aquatic Macroinvertebrates as Bioindicators of Water Quality: A Case Study River Kisat, Kisumu City Kenya.</strong></p><p>Otara M., Babu, J.M.<sup>1</sup>, Basweti G<sup>1</sup>, Wawiye P<sup>1</sup>, <sup>1</sup></p><p><sup>1</sup>Kenya Marine Fisheries Research Institute, P.O. Box 1881 - 00400, Kisumu, Kenya.</p><p><sup>2</sup>Department of Natural Resources and Environmental Science, P.O 408-40200, Kisii,Kenya</p><p><sup>3</sup>The Technical University of Kenya, P.O. Box 52428 - 00200, Nairobi, Kenya.</p><p><strong>Correspondance Author -Jared Miruka</strong></p><p><strong>Aquatic Macroinvertebrates as Bioindicators of Water Quality: A Case Study River Kisat, Kisumu City Kenya.</strong></p><p><strong>Abstract</strong></p><p>In this study, aquatic Macroinvertebrates were used as bioindicators to determine the ecological conditions of the river, located between Kisumu City.  The water quality of the river was evaluated through the calculation of the Puerto Rico Biological Monitoring Working Party (BMWP-PR), as well as its degree of contamination using the Puerto Rico Family Biotic Index (FBI-PR). Bimonthly sampling was conducted across four sampling sites for a period of 12 months. The sampling sites were positioned upstream and downstream within the the slums towards the downstream. The BMWP-PR results showed that the site upstream-inside the  wetland around the Lake Basin had good water quality, and the site downstream-inside the wetland towards the River Mouths had regular water quality, showing some areas around the industries had poor water quality. The FBI-PR results showed that there was mild organic contamination towards Kisat Sewage plant, while there was substantial organic contamination in the site that was outside-downstream towards the lake. We concluded that the section of the river located within the river channel from Kotut upward had better ecological conditions than the stretch of the river located inside-downstream to wetland, because it is located within a protected area that has barely been impacted by human activity. Besides, the  results can be used to rank the levels of pollution. Hence the indicies can be able to predict and predict future in case of   poor management practices</p><p><strong>Keywords: </strong></p><p><em>Aquatic Macroinveterbrates, </em><a href="https://www.mdpi.com/search?q=water+quality"><strong><em>water quality</em></strong></a><strong><em>, ecology,</em></strong></p>',
