      '<p><strong>Transboundary Collaboration for African Great Lakes Governance</strong></p><p>Zeph Migeni, Stephanie Smith</p><p>African Center for Aquatic Research and Education</p><p>This session will:</p><ol><li>Highlight progress and learnings from the African Great Lakes Advisory Groups</li><li>Launch a new model for African Great Lakes governance</li><li>Show connections to the African Great lakes and the United Nations Water Commitments</li></ol><p>The African Great Lakes (AGL), which are Lakes Albert, Edward, Kivu, Malawi/Niassa/Nyasa, Tanganyika, Turkana and Victoria, comprise 25% of the world’s surface fresh water and are significantly linked to the state of the blue economy in the region and globally. This session will showcase AGL Advisory Groups lessons learned from collaborative objectives and projects that have current and future impact on the state of the blue economy. We will introduce initial results from a new model for cross-lake partnership and governance through representation by a Council of Advisory Groups. Highlights will be shared from work guided by the United Nations Water Commitments, which serve to accelerate global progress on water-related Sustainable Development Goals. </p>',
