    path: 'dox/Blue Economy Policies and Governance/ORAL/transitioning towards an ecosystem approach to managing marine capture fisheries_ a case study of th.pdf',
    content:
      '<p><strong>Transitioning towards an ecosystem approach to managing marine capture fisheries: A case study of the Malindi-Ungwana Bay Prawn fishery</strong></p><p><sup>1</sup>Gladys Okemwa, <sup>2</sup>Elizabeth Mueni and <sup>1</sup>Joseph Kamau</p><p>The ecosystem approach to fisheries (EAF) has been widely promoted as the foundation to managing unsustainability in fisheries. The fishery system is seen as an integrated social-ecological system; thus, EAF addresses both human and ecological well-being to ensure the conservation of biodiversity, ecosystem structure and functioning, as well as socioeconomic benefits associated with provisioning of food, income and livelihoods. </p><p>The Malindi-Ungwana Bay prawn fishery provides a useful case study for examining progress and challenges to transitioning towards EAF-based management in Kenya. In this case study, the EAF-Implementation Monitoring Tool (IMT) was used to evaluate the governance system, and well as ecological and human wellbeing components of the fishery. Findings revealed that the fishery has a favorable governance structure that includes policies, legislation and regulatory frameworks, and the existence of a strong stakeholder consultation framework. Despite progress in meeting ecological and social wellbeing principles, there are areas of improvement.</p>',
