    title: 'Yield Data And Economic Valuation Of Mangrove Wood In Lamu, Kenya',
    author: 'Purity Muthoni Riungu',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'muthonipurity01@gmail.com',
    presentation_mode: 'Oral',
    recommendation: 'Oral',
    status: 'sent',
    path: 'dox/Community Engagement and Inclusivity/ORAL/yield data and economic valuation of mangrove wood in lamu_ kenya  purity_ m_ riungu1_2_ james g_ ka.pdf',
    content:
      '<p><strong>Yield Data and Economic Valuation of Mangrove Wood in Lamu, Kenya</strong></p><p>Purity, M. Riungu<sup>1,2</sup>, James G. Kairo<sup>1</sup>, Victor M. Alati<sup>1</sup> </p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute, P.O Box 81651-80100, Mombasa, Kenya</p><p><sup>2</sup>Presenting author Email: <a href="mailto:muthonipurity01@gmail.com">muthonipurity01@gmail.com</a>; Cell number: +254708787321 </p><h1><strong>ABSTRACT</strong></h1><p>Mangrove forests provide harvestable wood and non-wood resources to human society globally. These products are either used locally or traded in urban centres away from the forest. Commercial harvesting of mangroves is restricted to Lamu. <em>Rhizophora mucronata</em> and <em>Ceriops tagal </em>are dominant and the most exploited mangrove species for poles. The current study aimed at evaluating the yield data and economic value of mangrove wood in Lamu to inform on the socio-economic sustainability. A combination of forestry inventory techniques and social economic surveys was used. Structural data of the forests was collected within square quadrats of 20m by 20m established along belt transects perpendicular to waterline. Local stand tables were constructed to show the forest stocking rates. Direct market valuation technique (market price method) was used to value the mangrove poles since they are assigned “market prices”. The merchantable densities of the two principal species were estimated at 1,361 stems ha<sup>-1</sup>; represented mainly by <em>pau</em> sized poles (554 stems ha<sup>-1</sup>), then <em>fito</em> (480 stems ha<sup>-1</sup>) across the four blocks where harvesting is allowed. The total economic value of the mangrove forests of Lamu was estimated to be 5,660.58 ± 244.93 USD ha<sup>-1</sup>. The mangrove forests of the Southern swamps were estimated to have the highest economic value (1,758.93 ± 70.96 USD ha<sup>-1</sup>) while Dodori Mongoni creek swamps recorded the least at 1,174.57 ± 47.84 USD ha<sup>-1</sup>. <em>Vigingi</em> have the highest economic value 958.15 USD ha<sup>-1 </sup>while <em>boriti</em> recorded the least 459.02 ± 25.79 USD ha<sup>-1</sup>. The selective logging for poles has impacted the quality and stability of the forest. The findings of this study are critical in development of the harvesting plan for Lamu mangroves to ensure sustainable resource exploitation. The results provide insights toward streamlining mangrove trade for improved livelihood and revenue generation.</p><p><strong>Key Words:</strong></p><p><a id="_Hlk108602505"></a>                    Economic valuation, Mangrove wood, Yield data, Lamu</p>',
