    content:
      '<p><strong>Biotic and abiotic drivers of fish diversity, distribution and community structure among littoral fish assemblages in a tropical Lake</strong></p><p>Hilda Nyaboke<sup>1,2*</sup>, Chrisphine Nyamweya<sup>1</sup>, Monica Owili<sup>1</sup>, Okechi John<sup>1,3</sup>, Christopher Aura<sup>1</sup>.Vincent Sudoi<sup>2</sup>, David Liti<sup>2</sup></p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute (KMFRI), Kenya</p><p><sup>2</sup>University of Eldoret (UOE), Kenya</p><p><sup>3</sup>Boston University, USA</p><p><em>Corresponding Author: </em><a href="mailto:nyabokehilda@mail.com"><em>nyabokehilda@mail.com</em></a><em>, +254725788337</em></p><p><strong>Abstract</strong></p><p>Lake Victoria is the largest tropical lake in the world recognized globally for its rich species diversity. It is home to a rich itchy fauna dominated by cichlids, most of which are endemic to the lake with their closest relatives either in the Nile or Congo basin. In the face of global environmental change, understanding and predicting the effect of environmental parameters on biological communities is key to conservation and species recovery. This study explored the interaction of fish communities with environmental factors (both biotic and abiotic); and determined which of these factors govern their diversity, distribution and abundance within the littoral zones in Lake Victoria covering the entire Kenyan shoreline. Habitat differences were graded based on assessment of bottom substrate type and determination of key physico-chemical parameters and nutrient fractions. Fish communities were described on the basis of diversity, abundance and trophic guilds. Multivariate analysis was conducted to establish the relationship between environmental attributes and fish, and the distribution of fish species <em>vis-à-vis </em>physico-chemical parameters plotted from Principle Component Analysis (PCA). A correlation matrix was then developed on the dominant haplochromines against physico-chemical parameters to determine the contribution of the different parameters on their distribution and abundance. Using biological groups identified in the study, a trophic cascade was developed using the “food web R package” to show the interactions of the different biological groups derived from stomach content analysis. A total of 13 fish species were recorded during the survey with haplochromine cichlids being the most abundant fish group. Based on the bottom substrate, substratum heterogeneity was evident with three micro habitat types recorded (Sandy, rocky and muddy). A weak relationship exists with chlorophyll, pH and DO concentration. There is a negative correlation between the haplochromines with turbidity (-0.7), chlorophyll-a (-0.5), conductivity (-0.6) and total dissolved solids (TDS, -0.6). In conclusion, substratum heterogeneity and water physical attributes are a key factor in determining species composition while predation and competition for food resources form important biotic inputs for aquatic biological communities in L. Victoria. Conservation prioritization of river mouths and sheltered bays within Lake Victoria is recommended as biodiversity hotspots for indigenous fish species.</p><p><strong>Key words</strong>: Biological Community, habitat structure, diversity, littoral, composition</p><p>Th </p>',
