    title:
      "Harmony In Conservation: Exploring Fisherfolk's Insights On Ecosystem Transformations In Muhuru-Bay, Western Kenya",
    author:
      'Edwin Odhiambo Wagah, John Osodo Bonzo (Local Fisher), George Aira (Local Fisher), and Dr. Zsolt Molnar',
    country: 'Hungary',
    organization: 'Eotvos Lorand University',
