      '<p><strong>Will the Marine protected areas in the Kyoga basin lakes provide a future prospect for the fisheries? A case to answer.</strong></p><p>Bassa<sup>1*</sup>S., G. Dheyongera<sup>2</sup>, H. Nakiyende<sup>1</sup>; M. Olokotum, J.S. Balirwa<sup>1</sup>, E. Muhumuza<sup>1</sup>, R. Mangeni-Sande<sup>1</sup>, J. Nyaundi<sup>3</sup>, E. O. Ogello<sup>4</sup>,J. Lugya<sup>1</sup> , P. Byamukama<sup>2</sup> , A. Omolo<sup>2</sup> , M. Nsega<sup>1</sup> and W.N. Nkalubo<sup>1</sup>.</p><p><sup>\t1</sup>National Fisheries Resources Research Institute, P.O. Box 343, Jinja, Uganda.</p><p><sup>2</sup>Directorate of Fisheries Resources Entebbe, Uganda.</p><p><sup>3</sup>Kenya Marine Research Institute, Kisumu, Kenya</p><p><sup>4</sup>Maseno University, Kenya</p><p>*Corresponding author: <a href="mailto:bassasam2018@gmail.com">bassasam2018@gmail.com</a>; <a href="mailto:sambasa37@yahoo.co.uk">sambasa37@yahoo.co.uk</a></p><p><strong>Abstract</strong></p><p>Shallow inshore habitats of the Kyoga basin lakes (&lt; 2 meter depth) are considered as important fish breeding, nursery areas and also used as food and feeding zones in the ecosystem. Various sites were identified, characterized, mapped to provide information on critical habitats for protection and gazzetement. A total of 44 fish breeding sites were on average area of 100 acres that needed 18,907 markers for protection. Most of the areas identified were dominated with wetland mashes and other aquatic organism and plants. It is known that wetlands may protect fishes from introduced predatory fishes by providing both structural and low-oxygen refuge for prey species tolerant of the conditions that prevail in these habitats. Therefore size and location of these critical habitats need to be clearly demarcated to provide better scientific information for management decisions.</p><p><strong>Keywords:</strong> Fish migration, Fish recovery, <em>Lates niloticus,</em> pelagic fishes, protected areas, Responsible Fisheries</p>',
