      'Indiscriminate Dumping Of Plastics In Lake Victoria Basin Towns, Uganda: Recommendations For Sustainable Management',
    author: 'Fredrick J. Muyodi, Rosemary Nalwanga, Andrew M., Kantono Violet',
    country: 'Uganda',
