    title:
      'Fish Recruitment In Seagrass Habitats Of Watamu, Kilifi County, Kenya',
    author: 'James Mwaluma',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'jamesmwaluma@gmail.com',
    presentation_mode: 'Oral',
    recommendation: 'Oral',
