    path: 'dox/Marine Biology and Ecology/POSTER/species composition of fish and crustacean communities of tudor creek_ mombasa_ kenya  boaz okeyo or.pdf',
    content:
      '<p>SPECIES COMPOSITION OF FISH AND CRUSTACEAN COMMUNITIES OF TUDOR CREEK, MOMBASA, KENYA</p><p>Boaz Okeyo Orembo</p><p>Kenya Marine and Fisheries Research Institute</p><p>In coastal regions there is a multitude of competing activities, such as industries, urban development and fishing resulting in disruption of adjacent aquatic ecosystems. This study examined the species   composition and distribution of fish and crustacean communities in Tudor Creek, Mombasa, Kenya. The creek is subject to immense human activities, being in the vicinity of the harbor, a major highway and human settlements. The objective of the study was to investigate the possible influence of human activities on species composition and distribution of fish and crustacean of the creek in relation to past studies. Sampling was done from September, 2021 to May, 2022 using a beach seine net at five sampling stations. The sampling period covered the north east monsoon (NEM and south east monsoon (SEM) seasons. Ninety three (93) fish and 9 crustacean species belonging to 42 and 4 families respectively were recorded from the study site.  A total of 4028 fish and 2987 crustacean individuals representing 57 %and 43 % of the total catch respectively were recorded. Conversely, 79 fish and 9 crustacean species belonging to 36 and 4 families respectively were recorded during the NEM season, whilst 49 fish and 8 crustacean species belonging to 28 and 4 families respectively were recorded during the SEM season.  A total 2747 fish and 2281 crustacean individuals were recorded during the NEM season, while 1281fish and 706 crustacean individuals were recorded during SEM season.   The fish species composition results compare favorably with results of  previous studies in the same area though with slight variations in family and species types. Further investigation on the status of anthropogenic activities and their possible impacts on creek’s ecosystem and effective conservation measures are recommended.</p><p>Key words: Species composition, Fish, Crustacean, Tudor creek</p><p>Boaz Orembo</p><p>Kenya Marine and Fisheries Research  Institute , P.O Box 81651-80100, Mombasa, Kenya.</p><p>       E-mail:  <a href="mailto:okeyoboaz@yahoo.com">okeyoboaz@yahoo.com</a></p>',
