    path: 'dox/Marine Biology and Ecology/ORAL/response of primary consumers to resource pulses  angela nankabirwa1_ peter mcintyre.pdf',
    content:
      '<p><strong>Response of primary consumers to resource pulses</strong></p><p>Angela Nankabirwa1<sup><a href="#footnote-1" id="footnote-ref-1">[1]</a></sup>, Peter McIntyre</p><p>Cornell University, Ithaca, 14850 NY</p><p>The rise of harmful algal blooms (HABS) in freshwater and marine ecosystems presents a unique opportunity to study how producer traits and consumer responses can mediate the ecological outcomes of resource pulses and environmental perturbations. My work focuses on Winam Gulf, Lake Victoria, which often features HABs, and is the world’s largest lake fishery (~106 T annual harvest; LVFO 2021). Millions of people rely upon the lake for water and food, but the impact of cyanobacterial bloom dynamics on the quality of these resources is poorly understood. My study adopted an ecological lens using small crustaceans, that filter algae from water (zooplankton) which should be highly responsive to HABs due to their short life cycles and continual reproduction. Using a combination of regression style and complimentary experiments, I sampled zooplankton along a HAB gradient in Winam Gulf and corresponding environmental variables in June-July 2023.  My results show high temporal variation in zooplankton abundance and composition within all sites, which appears to reflect positive responses to algal biomass and conductivity. The maternal investment of zooplankton as a response to HABs is yet to be established. </p><p>Lab and data analysis is still ongoing, and I will update this abstract with more findings.</p><ol><li id="footnote-1"><p> Corresponding author email: an433@cornell.edu <a href="#footnote-ref-1">↑</a></p></li></ol>',
