    path: 'dox/Marine Biology and Ecology/ORAL/population structure_ connectivity_ and life history characteristics of thicklip grey mullets _chelo.pdf',
    content:
      '<p><strong>Population structure, connectivity, and life history characteristics of thicklip grey mullets (<em>Chelon labrosus</em>) inhabiting differentially contaminated estuaries in the southern Bay of Biscay</strong></p><p>﻿<strong> Anthony Nzioka<sup>1</sup>,</strong> Ibon Cancio<strong><sup>1</sup></strong>, Oihane Diaz de Cerio<strong><sup>1</sup></strong>, María José Madeira<strong><sup>2</sup></strong>, Lambros Kokokiris<strong><sup>3</sup></strong>, Maren Ortiz-Zarrogoitia<strong><sup>1</sup></strong>, Edgar Pinto<strong><sup>4,5</sup></strong>, Agostinho Almeida<strong><sup>4</sup></strong>, Alberto Teodorico Correia<strong><sup>6,7,8</sup></strong></p><p><strong>﻿</strong><em><sup>1</sup>CBET Research Group, Dept. Zoology &amp; Animal Cell Biology, Faculty of Science &amp; Technology and Research Centre for Experimental Marine Biology and Biotechnology (PiE–UPV/EHU), University of the Basque Country (UPV/EHU), Areatza Hiribidea s/n, 48620, Plentzia, Basque Country, Spain</em></p><p><em><sup>2</sup>SystBioGen Research Group, Dept. Zoology &amp; Animal Cell Biology, Faculty of Science &amp; Technology and Lucio Lascaray Research Centre, University of the Basque Country (UPV/EHU), Calle Paseo de la Universidad 7, 01006, Vitoria-Gasteiz, Spain </em></p><p><em><sup>3</sup>Department of Nutritional Sciences &amp; Dietetics, International Hellenic University, P.O. 141 Sindos, 57400, Thessaloniki, Greece</em></p><p><em><sup>4</sup>LAQV/REQUIMTE, Departamento de Ciˆencias Químicas, Faculdade de Farmacia (FFUP), Universidade do Porto (UP), Rua de Jorge Viterbo Ferreira 228, 4050- 313, Porto, Portugal </em></p><p><em><sup>5</sup>Departamento de Saúde Ambiental, Escola Superior de Saúde, P. Porto, Rua Dr. Ant´onio Bernardino de Almeida 400, 4200–072, Porto, Portugal </em></p><p><em><sup>6</sup>Centro Interdisciplinar de Investigaç˜ao Marinha e Ambiental (CIIMAR), Terminal de Cruzeiros do Porto de Leix˜oes, Avenida General Norton de Matos S/N 4550-208, Matosinhos, Portugal</em></p><p><em><sup>7</sup>Instituto de Ciˆencias Biom´edicas Abel Salazar (ICBAS), Universidade do Porto (UP), Rua de Jorge Viterbo Ferreira 228, 4050-313, Porto, Portugal</em></p><p><em><sup>8</sup>Departamento de Biologia e Ambiente (DeBA), Escola de Ciˆencias da Vida e do Ambiente (ECVA), Universidade de Tr´as-os-Montes e Alto Douro (UTAD), Quinta de Prados, 5001-801, Vila Real, Portugal</em></p><p>Thicklip grey mullet (<em>Chelon labrosus</em>) populations inhabiting contaminated estuaries in the southern Bay of Biscay have reported strong xenoestrogenic effects, resulting in high prevalence of intersex testes and increased ovarian follicular atresia. However, knowledge of population structure, connectivity and life history characteristics of the species is still lacking. This study investigated the population structure of <em>C. labrosus</em> using microsatellite markers analysis of 204 individuals collected from 5 selected estuaries along the Basque coast and 2 outgroups in the Bay of Cadiz and Thermaic Gulf. Otolith shape and elemental signature analysis of 60 adult individuals collected from two nearby estuaries, one with a high incidence of intersex condition (Gernika), and the other one pristine (Plentzia) was also used. Otolith shape analysis was performed using elliptic Fourier descriptors while elemental signatures (Ba, Co, Cu, Li, Mg, Mn, Ni and Sr) of whole otoliths were determined by inductively coupled plasma mass spectrophotometry. Of 46 microsatellites tested, results of 10 polymorphic microsatellites studied indicated that <em>C. labrosus </em>showed no evidence of genetic differentiation among individuals or sites. Bayesian clustering analysis revealed a single population in all sampled locations, indicating widespread genetic homogeneity of <em>C. labrosus </em>across the current sampling areas spanning the Atlantic and Mediterranean basins. Univariate and multivariate statistics performed on otolith shape and elemental signatures showed significant differences between locations. Canonical analysis of principal coordinates plots identified two different groups, each one belonging to each estuary of origin. Differences in whole otolith elemental signatures between locations were largely driven by Sr, Li (both higher in Plentzia) and Ba (higher in Gernika). ﻿The high overall re-classification success (98%) obtained from combining both otolith shape and elemental signatures suggests that mullets from Gernika and Plentzia form separated population units, indicating different life histories of exposure to xenoestrogens.</p><p><strong>Keywords: </strong><em>Chelon labrosus, Contamination history, DNA microsatellites, estuaries, natural tags, life history, population genetics, population structure</em></p>',
