    title:
      'An Assessment Of Organochlorine Pesticides In Different Functional Feeding Guilds Of Macroinvertebrates And Fish In Estuarine Ecosystems In South Coast, Kenya',
    author: 'Kobingi Nyakeya',
    country: 'Kenya',
    organization: 'KMFRI',
