    content:
      '<p><strong>An assessment of organochlorine pesticides in different functional feeding guilds of macroinvertebrates and fish in estuarine ecosystems in South Coast, Kenya</strong></p><p>Kobingi Nyakeya<sup>1,2*</sup>, James Onchieku<sup>2</sup>, Frank Onderi Masese<sup>3</sup>, Jane Moraa Nyamora<sup>2,4</sup>, Gilbert Atuga<sup>4</sup>, Albert Getabu<sup>2</sup>, Job Omweno<sup>5</sup></p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute (KMFRI), Baringo Station, P.O. Box 231, Marigat, Kenya.</p><p><sup>2</sup>Kisii University, School of Agriculture, P.O. Box 408, Kisii, Kenya</p><p><sup>3</sup>University of Eldoret, Department of Fisheries and Aquatic Sciences, P.O. Box 225, Eldoret, Kenya </p><p><sup>4</sup>Kenya Marine and Fisheries Research Institute (KMFRI), Mombasa Station, P.O. Box 81651, Mombasa, Kenya.</p><p><sup>5</sup>Kisii County, Ministry of Agriculture, Livestock and Fisheries Development, P.O. Box Private Bag, Kisii.</p><p>*Corresponding author: <a href="mailto:kobinginyakeya@gmail.com">kobinginyakeya@gmail.com</a></p><p><strong>Abstract</strong></p><p>Globally, estuarine ecosystems provide ecosystem goods and services worth $ 14 trillion yet are the most threatened due to widespread anthropogenic global change. Increased human population has seen tremendous pesticide application in agricultural production for food security. Data on accumulation of organochlorine pesticides (OPs) in lower trophic level organisms, particularly in the Kenyan coast, are scarce. This study investigated the presence of  various Ops, including hexachlorobenzene (HCB), hexachlorocyclohexanes (α-, β- and γ-HCH),  heptachlor, heptachlor epoxide, o,p’ and p,p’ DDT and their metabolites o,p’ and p,p’ DDD, and p,p’ DDE, Cis chlordane, trans nanochlor, and mirex in different functional feeding guilds of macroinvertebrates namely: the collector gatherer (C-G), scraper grazer (S-G), predator, Shredder, and filterer as well as fish, in estuarine ecosystems of South Coast, Kenya. All the OPs were frequently detected. Spatially, all the studied OPs concentration levels differed significantly (p&lt;0.05) among the different groups of macroinvertebrates and fish. Biomagnification was found in fish for all the studied OPs, an indication that Ops were transferred directly from macroinvertebrates to predating fish. Biomagnification also occurred between predator and S-G, S-G, shredder, filterer functional feeding groups. Although there exists concerns on the adverse effects to humans posed by pesticide residues in aquatic organisms reported from previous studies, macroinvertebrate functional groups and fish from the examined estuarine systems along the South Coast of Kenya are within the accepted limits by WHO hence fish is safe for human consumption. There is need, however, for regular monitoring for informed policy and decision making. The study also recommends for catchment land management practices to curb myriad anthropogenic activities that impacts on the south coast estuarine systems of Kenya.</p><p><strong>Keywords:</strong> Bioaccumulation, biomonitoring, biomagnification, ecotoxicology, pollution, trophic levels. </p>',
