    content:
      '<p><strong>Title </strong></p><p>Geomorphological Characteristics of Unnamed Undersea Features within the Exclusive Economic Zone of Kenya</p><p><strong>Authors</strong></p><p><sup>1</sup>Amon Kibiwot Kimeli*, <sup>1,4</sup>Daina Mathai, <sup>2</sup>Victoria Atieno Obura, <sup>1</sup>Amina Ochora Makori, <sup>1</sup>Samuel Ndegwa, <sup>1</sup>Noah Nzaluo Ngisiang’e, <sup>1</sup>Harrison Ochieng Ong’anda, <sup>1</sup>Joseph Nyingi Kamau, <sup>1</sup>Pascal Zawadi Thoya, <sup>1</sup>Melckzedeck Knight Osore, <sup>3</sup>Christine Atieno Omuombo and <sup>4</sup>Rochelle Wigley</p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute (KMFRI), Department of Oceanography and Hydrography, P.O. Box 81651-80100, Mombasa. Kenya.</p><p><sup>2</sup>Survey of Kenya, Hydrography Department, P.O. Box 64005 – 00620, Nairobi, Kenya.</p><p><sup>3</sup>Technical University of Kenya, Department of Geoscience and the Environment, P.O Box 52428 – 00200, Nairobi. Kenya.</p><p><sup>4</sup>Center for Coastal &amp; Ocean Mapping/Joint Hydrographic Center, Jere A. Chase Ocean Engineering Lab, 24 Colovos Road. Durham, New Hampshire 03824. USA.</p><p><strong>*Corresponding author:</strong> Amon Kimeli </p><p>       Email: <a href="mailto:akimeli@kmfri.go.ke">akimeli@kmfri.go.ke</a></p><p><strong>Abstract</strong></p><p>High-resolution bathymetric data collected using a multibeam echosounder (MBES) in the Exclusive Economic Zone (EEZ) of Kenya reveal three large, and distinct undersea features west of the Central Indian Ridge (CIR) and north of the Southwest Indian Ridge. One of these features is a seamount situated in the southern sector of the surveyed Kenya‘s EEZ at coordinates 4.707°S and 42.109°E, with a total relief of 1,681 m. The other two features are hills located at the mid-section at 3.090°S and 41.919°E, exhibiting a total relief of 819 m, and in the northern sector of the EEZ at 2.158°S and 42.297°E, with a total relief of 547 m. All three identified undersea features exhibit similar characteristics, with the most notable ones being their conical shapes, singular peaks, and circular bases. While this study does not explore the seismic and sub-bottom characteristics of these features, their locations and shapes suggest a connection with the evolutionary history of the Indian Ocean basin, possibly indicating extrusive volcanic features. The tectonic structure of the Indian Ocean also implies the emplacement of these identified seamounts may be attributed to hotspot volcanism due to the separation and movement of the Madagascar, Africa and the Indian Plates. Prior studies have indicated that the tectonic setting of the Indian Ocean implies the presence of similar features, with identified seamounts and hills potentially linked to Late Cretaceous hotspot volcanism.</p><p><strong>Key words:</strong> Kenya, Indian Ocean, EEZ, Multibeam, Undersea features, Tectonics, Seamount, Hill</p>',
