    title:
      'Kenya Marine Waters Evolution During The Satellite Era: Insights From Remote Sensing',
    author: 'Damaris Muthio Mutia',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'mutiadamaris@gmail.com',
    presentation_mode: 'Oral',
    recommendation: 'Accept',
