    path: 'dox/Oceanography and Climate Change/ORAL/the sedimentary phosphorus _p_ and iron _fe_ concentration of winam gulf surficial sediments_ spatia.pdf',
    content:
      '<p><strong>THE SEDIMENTARY PHOSPHORUS (P) AND IRON (FE) CONCENTRATION OF WINAM GULF SURFICIAL SEDIMENTS: SPATIAL DISTRBUTION AND IMPLICATIONS OF THE NUTRITIVE ELEMENT CYCLING AND LAKE EUTROPHICATION IN A SHALLOW BASIN.</strong></p><p>*Mwamburi J.<sup>a</sup>, Aura, C. M.<sup>a</sup>, Osano O.<sup>b</sup> Humphrey, Olivier S.<sup>c</sup>, Marriott, A. L.<sup>c</sup>, Michael J. W.<sup>c</sup>, Sophia M. Dowell<sup>,c,d</sup>, Nyamweya, C. S.<sup>a</sup>, Ongore, C. O.<sup>a</sup></p><p><sup>a</sup>Kenya Marine Fisheries Research Institution (KMFRI), P.O. Box 1881-40100, Kisumu, Kenya.</p><p><sup>b</sup>School of Environmental Sciences, University of Eldoret, Eldoret, Kenya.</p><p><sup>c</sup>Inorganic Geochemistry, Centre for Environmental Geochemistry, British Geological Survey, Nottingham, UK.</p><p><sup>c</sup>School of Geography, Earth and Environmental Sciences, Plymouth University, UK.</p><p>* Corresponding author</p><p><strong>Abstract</strong></p><p>Phosphorus (P), nitrogen (N) and iron (Fe) are essential elements, frequently monitored in the water column and sediments, to understand their sources, impacts on water quality and bioavailability, which influences the phytoplankton community structure and subsequent development of algal blooms. A first and comprehensive sampling of the Winam gulf surficial sediments was undertaken to understand the pool and areal distribution of the major nutritive elements, which at some level may contribute to the limitation of primary productivity and eutrophication of the lake ecosystem. P can exist bound to minerals or partitioned in other operationally defined phases in the water column. Surficial sediment P and Fe concentration ranged from 0.0095% to 0.3082% and 0.8830% to 27.88% respectively. Levels of P increased from the gulf towards the main lake-gulf exchange areas, with much higher contents around the Southwest and north eastern gulf areas. High P variations were observed in river channels, with no clear trends. Fe exhibited higher levels upstream the rivers. In the lake, elevated sediment – Fe occurred around inner river mouths, Homa bay and channel areas (&lt;8.34% Fe). In general, levels are more of a reflection of increasing influx of externally derived erosional materials, which remain in suspension around the discharge zones and later redistribution in deeper areas of the gulf. Similar elevated P in deeper sediments around the narrow channel towards Rusinga Island was reported previously, a contribution of high sedimentation of organic rich sediments and particulate derived –P. After demolition of Mbita causeway, high current wash-out and erosion and redistribution of clastic materials particulate can also greatly modify other external and internally sourced elements in sediments. More information on geochemical speciation and cycling of sediment-P is valuable in overall understanding of P availability and possibly the control on frequent development of algal blooms.</p><p><strong>Keywords</strong>: Winam gulf; Sedimentary environments; Element remobilization; Iron, Phosphorus; Eutrophication</p>',
