    title:
      'The Distribution Of Anthropogenic Litter In Selected Beaches And Nearshore Waters Of The Great Rift Valley: A Case Study Of Lakes Naivasha And Baringo',
    author: 'Chepkemboi Purity',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'puryrop75@gmail.com',
    presentation_mode: 'Oral',
