      'Social And Economic Implications Of Adopting Energy Efficient Wood Fuel-Based Cook Stoves For Sustainable Mangrove Forest Management In Lamu And Tana River Counties, Kenya',
    author: 'Felix Kioko',
    country: 'Kenya',
