    content:
      '<p><strong>SPATIAL-TEMPORAL STRUCTURE AND COMPOSITION OF PHYTOPLANKTON ALONG</strong></p><p><strong>THE KENYAN COAST</strong></p><p><strong>Authors:</strong> Gilbert Owato1, *Eric Okuku1, Catherine Mwalugha1, Maureen Kombo1, Purity Chepkemboi1, Kenneth Otieno1, Mary Mbuche1, Mary Mkonu1, Alex Fulanda1 </p><p><em>1Kenya Marine and Fisheries Research Institute</em></p><p>Corresponding author: <em>owatogilbert@gmail.com</em></p><p>Phytoplankton play a pivotal role as primary producers in aquatic ecosystems as the global carbon cycle support marine food webs. This study aimed to assess the diversity, distribution and abundance of phytoplankton species along the Kenyan Coastal waters. A comprehensive survey was conducted quarterly in 2022 and 2023 in the coastal critical habitats and other pollution impacted areas. Surface seawater was filtered through a phytoplankton net, followed by laboratory analysis for taxonomic identification and quantification. A total of 1,457,771 phytoplankton taxa were identified. Cell densities were composed of<em> </em>diatoms D<em>inoflagellates, Cyanobacteria, Chlorophyta, Flagellates</em>, and S<em>ilicoflagellates </em>which<em> </em>varied. Taxa with capability of toxin-production, associated with harmful algal blooms (HABs) , included species of<em> Alexandrium </em>diversity H<em>’</em> 2.54 ± 0.38<em>, Gambierdiscus</em>, H<em>’</em> 0.81 ± 0.28, <em>Prorocentrum </em>H’ 2.12±0.81, <em>Pseudo-nitzschia </em>H’ 1.69 ± 0.09,<em> Thalassiosira </em>H’ 2.40 ± 0.38<em> </em>and <em>Skeletonema </em>H<em>’</em> 2.30 ± 0.56 only encountered during the during southeast monsoon while <em>Anabaena </em>H<em>’</em> 3.07 ± 0.00 that was encountered during the during Northeast monsoon. </p><p>The Diversity indices indicated variations along the coastline for the species richness (S) and Evenness (E) Index with the highest observed in the North Coast (S) 24.8 ±0.6, (E) Index of 0.801 ±0.014 and the lowest in Mombasa S 18.7 ± 0.8, (E) Index of 0.797 ±0.026. North coast had the highest mean abundance of 5,812 ± 1,125 number/L and a diversity <em>H’ </em>of 2.50 ± 0.05 observed. South Coast had the least abundance of 1,869±1,600 number/L and Mombasa with the least diversity H<em>’</em> 2.20 ± 0.06.</p><p>Generally, this study provided valuable insights into the ecological dynamics of phytoplankton spatial distribution and highlighted their crucial role in marine biodiversity, nutrient cycling, and ecosystem functioning. Understanding phytoplankton dynamics is essential for effective coastal management and conservation efforts in the face of environmental challenges and climate change.</p>',
