      '<p><strong>Long-term satellite derived and <em>in vivo</em> monitoring of CyanoHABs in the Winam Gulf of Lake Victoria, Kenya.</strong></p><p> </p><p><sup>1, 3,</sup> * Naftaly Mwirigi, <sup>2,3 </sup>Emma Tebbs, <sup>1,3 </sup>Winnie Owoko</p><p> </p><p><sup>1 </sup>Freshwater Systems Department, Kenya Marine and Fisheries Research Institute, P.O. Box1881, 40100, Kisumu, Kenya</p><p><sup>2 </sup>Department of Geography, King’s College London, 6.03, Bush House (NE), 40 Aldwych, London WC2B 4BG</p><p><sup>3 </sup>African Lakes Remote Sensing Network, African Centre for Aquatic Research and Education, Ann Arbor, MI 48105-2957</p><p><sup>4 </sup>Department of Public and Ecosystem Health, College of Veterinary Medicine, Cornell University, Ithaca, NY 14853</p><p>*Corresponding Author’s email: <a href="mailto:nmwirigi@kmfri.go.ke">nmwirigi@kmfri.go.ke</a> / <a href="mailto:naphtaleenavs@gmail.com">naphtaleenavs@gmail.com</a></p><p> </p><p><strong>Abstract</strong></p><p>Aquatic ecosystems are changing as a result of climate change while facing progressive increase in pollution, eutrophication and deoxygenation that will intensify over time due to rising population. At the same time, there is scientific agreement that over the past few decades, harmful algal blooms (HABs) have become more detrimental to ecosystems, fisheries, recreation, tourism, and public health. Cyanobacteria (blue-green algae) are capable of producing a wide range of bioactive substances, including cyanotoxins. The most frequently detected cyanotoxin, microcystin (MCs), poses risks to both the aquatic environment and human health. Despite the fact that human activity induced climate change has been shown to support worldwide trends in HABs, individual events are still influenced by local, regional, and global factors, making it crucial to properly assess the circumstances and reactions at the right scales. The project’s objective is to consolidate long-term satellite derived Chlorophyll-a data and compare with <em>in vivo</em> Chlorophyll-a daytime estimates from YSI 6600 and C3 fluorometer sondes geo-statically located on the Kenyan portion of Lake Victoria, Kenya for continous monitoring and informed management.</p><p> </p><p><strong>Keywords:</strong> Harmful algal blooms, Lake Victoria, remote sensing</p>',
