      '<p><a id="_Hlk155360812"></a><strong>Yield Trends and Exploitation Patterns of the Commercial Fisheries in Kyoga Basin Lakes and Future Prospects.</strong></p><p>Bassa<sup>1*</sup> S., G. Dheyongera<sup>2</sup>, H. Nakiyende<sup>1</sup>; M. Olokotum, J.S. Balirwa<sup>1</sup>, E. Muhumuza<sup>1</sup>, R. Mangeni-Sande<sup>1</sup>, J.Lujja<sup>1</sup>, J.Nyaunde<sup>3</sup>, E.O.Ogello<sup> </sup>and W.N.Nkalubo<sup>1</sup>.</p><p><sup>1</sup>National Fisheries Resources Research Institute, P.O. Box 343, Jinja, Uganda.</p><p><sup>2</sup>Directorate of Fisheries Resources Entebbe, Uganda.</p><p><sup>3</sup>Kenya Marine Research Institute, Kisumu, Kenya</p><p>*Corresponding author: <a href="mailto:bassasam2018@gmail.com">bassasam2018@gmail.com</a>; <a href="mailto:sambasa37@yahoo.co.uk">sambasa37@yahoo.co.uk</a></p><p><strong>Abstract</strong></p><p>The Kyoga basin lakes fisheries play a vital role in sustaining the livelihoods of the fisher communities economically as well as food security and nutrition.  However, fish catches from these lakes have declined despite increasing effort. This study provides information on the trends in yield and exploitation rates of the commercial fisheries in Kyoga basin lakes and its future prospects between 1991 and 2014, and part 2021. Fishing effort increased from 10,950 boats in 1991 to 14,787 with corresponding increases annual catches and beach value respectively of 43,322 tonnes worth US$22 in 1991 to 75,731t worth US$39 between 2013 and 2014 however, this was almost 3 times less than the catch recorded in 1977. During this period, the species composition in the commercial fisheries changed from <em>Lates niloticus</em> (Nile perch) and <em>Oreochromis niloticus</em> (Tilapia) to pelagic fishes especially <em>Ratrineobola argentae </em>whose catch rate increased to<em> 9</em>.77±1.52 kg/boat/day in 2013 and 2014 from less than 1 kg/boat/day between 2008 and 2009.  Though we see a change in demersal stock of the Nile perch with 88.2 kg/boat/day as compared to the pelagic such as <em>Rastrineobola argentae</em> with 66.6 kg/boat/day in 2023. Thus due to changes in fisheries, there is need to understand its dynamics in order to have appropriate methods for harvesting to instil recovery.</p><p><strong>Key words:</strong> Total catches, effort, food security, income</p>',
