    path: 'dox/Sustainable Fisheries and Aquaculture/ORAL/effectiveness of biochar based biofilter media on water quality management in recirculating aquacult.pdf',
    content:
      '<p><strong>Effectiveness of biochar based biofilter media on water quality management in recirculating aquaculture system</strong></p><p><strong>Emily Wafula<sup>1</sup>, Zipporah Gichana<sup>2</sup>, James Onchieku<sup>2</sup> Kobingi Nyakeya<sup>1</sup>, Safina Musa<sup>1 </sup>and Paul Orina<sup>1</sup></strong></p><ol><li><strong>Kenya Marine and Fisheries Research Institute P.O box 1881 Kisumu</strong></li><li><strong>Kisii university P.O box 408-40200 Kisii</strong></li></ol><p><strong>Abstract</strong></p><p>Maintaining water quality in recirculating aquaculture systems (RAS) for optimal fish production necessitates the use of expensive biofilters. Exploring the potential of locally available biofilter media, on the other hand, provides possibility of improving water quality and reducing operational costs. The purpose of this study was to evaluate the efficiency of biochar-based biofilters in RAS. A completely randomized design with three replicates was used to represent three distinct biofilter treatments: Treatment 1 (<em>S. oleracea</em>-only biofilter), Treatment 2 (biochar-only biofilter), and Treatment 3 (biochar with <em>S. oleracea</em> biofilter). Water quality parameters were monitored within fish tanks as well as at the inlet and outlet of each biofilter treatment. A two way ANOVA was used to assess the biofilter efficiency. Water temperature remained relatively low across all treatments, with mean values of 20.26±1.15°C, 20.33 ±1.12°C, and 20.22 ±1.21°C in the first, second, and third treatments, respectively. Dissolved oxygen levels varied significantly (p ˂ 0.05) between treatments, with the <em>S. oleracea</em>-only treatment averaging 5.99 ±1.82 mg/L, the biochar-only treatment at 5.80 ±1.68 mg/L, and the biochar with S<em>. oleracea </em>treatment reaching 8.06 ±26.11 mg/L. In terms of ammonia levels, the<em> S. oleracea</em>-only treatment had significantly higher levels (p˂0.05) at 0.49±0.09 mg/L compared to the biochar-only treatment (0.28±0.09 mg/L) and the biochar with <em>S. oleracea</em> treatment (0.31±0.08 mg/L). However, no significant differences in nitrite and nitrate removal were found between the biochar-only and biochar with <em>S. oleracea</em> biofilter treatments. These findings highlight the effectiveness of biochar-based biofilters in improving water quality and promoting aquaculture sustainability. Future research endeavors should focus on the utilization of biochar-based biofilters within large-scale or commercial RAS. The overarching aim should be to enhance aquaculture production and environmental conservation efforts.</p><p><strong> Keywords</strong>: Biological filtration, cost-effective, efficiency, biochar, Nile tilapia, nutrient removal</p>',
