      '<p><strong>TITLE: ASSESSMENT OF THE STATUS OF FISH BYCATCH IN LAKE TURKANA TO DETERMINE THEIR POTENTIAL AS AN ALTERNATIVE SOURCE OF INCOME</strong></p><p><strong>Bironga, C.H.<sup>1*</sup>, Malala, J.O.<sup>1</sup>, Olilo, C.O.<sup>1</sup>, Obiero, M.O.<sup>1</sup>, Nyamweya, C.S.<sup>2</sup>, Aura, M.C.<sup>2</sup> &amp; Njiru, J.M.<sup>3</sup></strong></p><p><sup>1</sup>KENYA MARINE AND FISHERIES RESEARCH INSTITUTE, LAKE TURKANA STATION, P.O. BOX 205 – 30500 LODWAR, KENYA</p><p><sup>2</sup>KENYA MARINE AND FISHERIES RESEARCH INSTITUTE, KISUMU CENTRE, P.O. BOX 1881 – 40100 KISUMU, KENYA</p><p><sup>3</sup>KENYA MARINE AND FISHERIES RESEARCH INSTITUTE, HEADQUARTERS, P.O. BOX 81651 – 80100 MOMBASA, KENYA</p><p><sup>*</sup>CORRESPONDING AUTHOR: <a href="mailto:cbironga@kmfri.go.ke">cbironga@kmfri.go.ke</a></p><h1><a id="_Toc106382395"></a>ABSTRACT</h1><p>Fisheries are important to economies and contribute to food security and nutrition, but worldwide fish populations are threatened by inadequate management and poor conservation. When assessing the fishing industry\'s impact, it is important to keep in mind the industry\'s often-overlooked victims: the aquatic lives of animals such as fish and birds killed as bycatch. More often than not, fishing for a certain target species quickly escalates into non-target species being caught and killed. The lack of extensive monitoring systems in most places to assess bycatches and integrate them into population and multispecies models makes it difficult to fully comprehend the impacts of bycatch and the efficacy of mitigation efforts and as a result, bycatch data tends to be outdated and inaccurate. In artisanal fisheries in developing countries, it is likely that much of the bycatch is consumed rather than discarded but there is little quantitative data to support that supposition. As such, this study undertook to assess the status of fish bycatch in Lake Turkana to enable determine their potential as an alternative source of income. This was to be achieved through the identification of bycatch issues of concern in Lake Turkana, collection of quantitative and qualitative data on those issues and determining the commercial value of fish bycatch in Lake Turkana. Untargeted fish from Lake Turkana form a crucial part of the fish catches that are landed from the fishery annually. The Lake Turkana fishery bycatch has <em>Brycinus minutus, Lates longispinis, Schilbe uranoscopus, Labeobarbus bynni, Clarias gariepinus</em> and <em>Distichodus niloticus</em> being commercially viable. These fishes make up more than 3,000 metric tonnes or 16% of the Lake Turkana fish catches as per the modelled total catches from July 2020 to June 2021 of 19,000 metric tonnes. With the Lake Turkana bycatch falling below 20%, they are within the sustainable bycatch threshold.</p><p><strong>Keywords words:</strong> Bycatch, commercial viability, gear selectivity, target catches.</p>',
