    content:
      '<p>Nutritional composition of value-added fish products from selected fish species in Kenya</p><p>Cecilia Githukia, Maureen Cheserek, Dennis Otieno, Evans Menach, Domitila Kyule-Muendo, Kevin Obiero, Jonathan Munguti</p><p>Kenya Marine and Fisheries Research Institute</p><p>Fish is an important seafood that provides quality nutrients to human beings which is vital for health and development. This is especially critical in the diets of children under two years old and reproductive women (pregnant and lactating). Selected fish species were sampled from both Lake Victoria and fish farms, and their weight was determined using a sensitive weighing balance and fish-based products (powder and gelatin) developed to food-grade standards. The proximate composition of minerals, amino acids, and fatty acids profile were assessed in the laboratory, and data were analyzed using R statistic tool version 4.2.2 to understand the differences between the variables at a significance level of p &lt; 0.05. Results indicated that crude fat ranged from 3-23%, crude protein was highest in Nile perch gelatin at 81.22±1.43 while <em>omena</em> and <em>haplochromine</em> <em>spp.</em> had the highest concentration of calcium at 6347.1±428.5 and 4522.0±233.3 mg/Kg respectively.  The highest concentration of essential amino acids was found in <em>Omena</em> and Nile perch powder. Among the fatty acids; oleic and palmitic were the dominant fatty acid in the fish products at 25.12±0.56% - 45.12±0.65% and 20.52±0.69% - 44.23±0.74% respectively.  The moisture content of the final products was between 4.64 ±0.08% - 8.82±0.35%, which was within limits ensuring little microbial activity thus enhancing the shelf-life of the final products. The developed products had nutrients that are beneficial to human health at desirable concentrations and are recommended for inclusion in the diet of vulnerable groups for a prosperous community free from hunger and malnutrition.</p><p><strong>Keywords: </strong> Proximate composition, Minerals, Amino acids, Fatty acids</p>',
