    title: 'Zooplankton Field Sample Collection And Enumeration',
    author: 'Harriet Atieno Okeyo',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'okeyoharriet859@gmail.com',
    presentation_mode: 'Oral',
    recommendation: 'Poster',
