    path: 'dox/Sustainable Fisheries and Aquaculture/POSTER/zooplankton field sample collection and enumeration.pdf',
    content:
      '<p><strong>ZOOPLANKTON FIELD SAMPLE COLLECTION AND ENUMERATION</strong>\t</p><p><strong><em>Author</em></strong><em>;Harriet A Okeyo<sup>1</sup>,Sharon Miniga<sup>1</sup>, Evans Abich<sup>1</sup>, James Achiya<sup>1</sup>, Dennis O Otieno<sup>1</sup></em></p><p><em><sup>Kenya Marine and Fisheries Research Institute</sup></em></p><p><strong>ABSTRACT</strong></p><p>Understanding different zooplankton abundance and sampling depends on comparing similar data sets. Scientists employ numerous different methods to collect and count freshwater zooplankton leading to difficulties when comparing studies. We quantified how net mesh size and counting techniques influence zooplankton size and abundance estimates. This abstract presents comparative analysis of field collection and sample enumeration methods employed in zooplankton research. Mesh sizes were compared by zooplankton collection with differing vertical hauled nets. Choice of mesh size depends on the size, morphology, and rigidity of the organisms being sampled. Choosing the mesh size that will collect the desired size-class of target organism should maximize sampling effectiveness while minimizing clogging problems and reduction in net performance. By sampling zooplankton with vertically hauled nets that vary in mesh size, we were able to compare the efficacy of mesh sizes. Samples were counted to compare abundance. We found that only 64-µm mesh nets effectively capture small-bodied zooplankton; small cladocerans, copepod, nauplii, and rotifers (mean size = 0.13−0.30 mm) whereas the other nets effectively collected larger-bodied zooplankton (mean size &gt; 0.48 mm). The &gt; 100 µm-mesh nets were &gt; 60% efficient. In contrast, the 64-µm mesh net was at best 90% efficient; hence, actual volume sampled must be determined to avoid underestimation and mesh size will differ depending on your target organisms, meaning it won’t collect the small ones. We found counting-method-specific shortcomings, particularly for those in which few individuals were counted. We recommend, that a moderate number of individuals are counted for many finely resolved taxonomic categories or many individuals are counted for fewer, broader taxonomic categories. Microscopy remains a gold standard, offering high precision and species-level identification but is labor-intensive and time-consuming.  </p><p><strong>Keywords:</strong> Zooplankton, enumeration. <strong> </strong>   </p>',
