    content:
      '<p><strong>Growth performance and survival of four A<em>rtemia franciscana</em> populations subjected to different temperatures</strong></p><p>Morine M. Ngarari<sup>1,2*</sup>, Betty M. Nyonje<sup>1</sup>, Charles C. Ngugi<sup>2</sup>, James M. Mwaluma<sup>1</sup> </p><p><sup>1</sup> KMFRI, Mombasa, Kenya</p><p><sup>2</sup> Karatina University, Nyeri, Kenya</p><p><sup>*</sup> <a href="mailto:morinemukamik@gmail.com">morinemukamik@gmail.com</a></p><p>Abstract: </p><p><em>Artemia,</em> a cosmopolitan organism, inhabits coastal lagoons, inland salt lakes etc. where there are no or few predators and competitors. Geographical isolation of <em>Artemia</em> biotopes has led to numerous geographical populations that have adapted to conditions that fluctuate widely with regard to temperature, salinity and ionic composition of the biotope. <em>Artemia franciscana</em> endemic to America, is present in other continents due to its introduction for aquaculture purposes. <em>A. franciscana </em>from San Francisco Bay (SFB), USA was introduced in man-made saltworks in Kenya and Vietnam in mid-80’s. Despite Kenya and Vietnam having higher temperatures compared to SFB, the <em>A. franciscana</em> adapted well. This study aims to establish how <em>A. franciscana</em> evolved from the original SFB population four decades after its introduction into new environments with different temperature regimes. For this study, two <em>A. franciscana</em> cyst samples from Kenya, one from Vietnam and one from SFB were used. Cysts were hatched into nauplii using optimal hatching conditions. Three hundred nauplii were placed in 0.25 L culture volumes and cultured under temperature replicate treatments of 28.0, 32.0 and 36.0 °C ± 0.5 °C. Constant salinity of 80 ppt and aeration were maintained throughout the culture period. Nauplii were fed on <em>Dunaliella tertiolecta</em>. Length and survival data were measured on the fourth day after hatching and then repeated after every four days. One-way ANOVA test was applied on all treatments to find the overall effect of treatment on length and survival. Turkey’s pairwise multiple comparison was used to detect significant differences between the experimental sample means at a significance level of p≤0.05. Two-way ANOVA of length and survival data was used to detect significant interactions between population and temperature. Results indicate there are marked differences between similar <em>A. franciscana</em> populations due to their geographical distribution since they are all subjected to different environmental conditions. </p>',
