    content:
      '<p><strong>Title</strong>: Navigating Data Gaps: Integrative Stock Assessment Models Inform Sustainable Management of Artisanal Fisheries in Lake Albert.</p><p><strong>Authors: Nakiyende Herbert<sup>1,2*</sup>, Basooma Anthony<sup>1</sup>, Nyamweya Chrispine<sup>3</sup>, Nkalubo Winnie<sup>1</sup>, Lauren Chapman<sup>4</sup>.</strong></p><p><sup>1</sup>National Fisheries Resources Research Institute (NaFIRRI), P.O. Box 343, Jinja, Uganda.</p><p><sup>2</sup>Makerere University P.O. Box 7062, Kampala, Uganda.</p><p>3Kenya Marine and Fisheries Research Institute, P.O. Box 81651 - 80100<br />Mombasa, Kenya</p><p><sup>4</sup>McGill University, Department of Biology, 1205 Dr. Penfield Avenue, Montreal, Quebec, Canada, H3A 1B1. </p><p>*<strong>Corresponding author email</strong>: nakiyende@yahoo.ie; nakiherbert@gmail.com</p><p><strong>Abstract</strong></p><p>Achieving resource sustainability in data-poor fisheries remains a global challenge, leading to adoption of stock assessment models to navigate data limitations. However, such models are yet to be applied on Lake Albert, a data-deficient African Great Lake with a species-rich artisanal fishery. In this study, we employ Virtual Population Analysis (VPA), Schaefer, Fox, and Catch MSY models, to establish growth parameters and biological reference points for <em>Engraulicypris bredoi </em>and <em>Brycinus nurse</em> in Lake Albert. Utilizing length data (February 2021 to June 2022) for VPA model and catch and effort data (2007, 2012, 2013, 2014, 2019, 2022, 2021, and 2022) for Schaefer, Fox and Catch MSY models, we reveal comparable estimates among models, indicating their appropriateness for informing the lake’s management decisions. The estimated maximum sustainable yield (MSY) for <em>B. nurse </em>ranged from 34,469 tonnes (t) to 37,599 t, while for <em>E. bredoi, </em>it ranged from 83,587 t to 90,858 t. The MSY and fishing effort at MSY exceeds the current levels, while fishing mortality and exploitation rate are below thresholds of F01, F05, and Fmax, pointing to underfishing and potential for heightened catch and effort. However, the vulnerability of <em>B. nurse </em>to fishing mortality at a smaller size before reproductive maturity raises concerns over its sustainability. These findings indicate generally health stocks of <em>E. bredoi </em>and <em>B. nurse</em>, under low exploitation pressure, while underscoring the need for species-specific licensing, robust regulations consistent with a multi-species fishery, regular monitoring, and comprehensive assessments to understand ecosystem dynamics for the long-term sustainability.\t  </p><p><strong>Key words</strong>. biological reference points, data-poor fisheries, fishing mortality, maximum sustainable yield, multi-species fishery, size at first capture.</p>',
