    title:
      'The Effect Of Different Feeding Rates And Fertilization On Water Quality, Production, And Economic Performance Of Nile Tilapia Farming In Low Input Pond Culture',
    author: 'Safina Musaa',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'smusa@kmfri.go.ke',
    presentation_mode: 'Oral',
