      'Catch Composition Of Artisanal Fishery Of Lake Baringo, Kenya And Its Contributions To Some Livelihoods Aspects',
    author: 'Mugo, James. Murakaru',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'mugojam@yahoo.com',
    presentation_mode: 'Oral',
    recommendation: 'Poster',
    status: 'Sent',
    path: 'dox/Sustainable Fisheries and Aquaculture/ORAL/catch composition of artisanal fishery of lake baringo_ kenya and its contributions to some liveliho.pdf',
    content:
      '<p><strong>Catch composition of artisanal fishery of Lake Baringo, Kenya and its contributions to some livelihoods aspects</strong></p><p><sup>*1</sup>Mugo, J. M., <sup>1</sup>Odoli, C., <sup>1</sup>Nyakeya, K., <sup>2</sup>Nyamweya , C.,  <sup>2</sup>Aura, C,M</p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute</p><p>Baringo Station, P.O Box 231 Marigat, Kenya</p><p><sup>2</sup>Kenya Marine and Fisheries Research Institute</p><p>Kisumu Centre, P.O. Box 1881 Kisumu, Kenya</p><ul><li>Corresponding Author</li></ul><p>Email <a href="mailto:mugojam@yahoo.com">mugojam@yahoo.com</a></p><p><strong>Abstract</strong></p><p>The fisheries industry occupies an important role as a foreign exchange earner in the world, a source of food security and a source of employment opportunity to many people. Despite the importance of this sector there are still insufficient information concerning livelihood aspects in Lake Baringo. The purpose of this study was therefore to assess catch composition of artisanal fishery of Lake Baringo and its contributions to some livelihoods aspects such as nutrition/food, shelter/personal effects and education among others. The study employed mixed methods comprising literature review, direct observation (catch assessment surveys, CAS) and questionnaire survey. Results indicate that finances accrued from fishery resource are utilized mostly for nutritional needs 37% followed by shelter/personal effects 22% and education 13%. Fishermen used long lines with an average of 273±6.0 SE hooks of sizes 8 and 9 to catch <em>Protopterus aethiopicus</em> and <em>Clarias gariepinus, </em>whose composition was 47.7% and 29.8% respectively. Gill nets of sizes 62.5, 75, 87.5, 100 and 125 mm stretched mesh were used to catch <em>Oreochromis niloticus</em> and <em>Labeobarbus intermedius</em>. The average catch per boat (CPUE) was highest for <em>Protopterus aethiopicus </em> at 24.02 Kg/boat/day followed by <em>Clarias gariepinus,</em> 7.68 Kg/boat/day while <em>Labeobarbus intermedius</em> had the lowest catch of 1.65 Kg/boat/day. The total annual fish landings were estimated at 360 tons with an estimated beach price of KSh 50.4 Million.  The financial resources ensued from fishery is still minimal as CPUE is still low, with over 55% of livelihood needs being on food and shelter. Longline is the major gear contributing 78% of the catch landed with high average number of hooks per fisherman. This study recommends effective enforcement of fisheries regulations by all relevant enforcement agencies for the fishery to be sustainable and meet livelihood needs of stakeholders.</p><p><strong><em>Key Words: Artisanal fishery, Lake Baringo, Livelihood aspects, Long line. </em></strong></p>',
