      '<p><strong>Social economic lessons from commercialization of seaweed farming in the South coast of Kenya.</strong></p><p><strong>Dr. Elisha Mrabu Jenoh</strong></p><p>Kenya Marine and Fisheries Research Institute</p><p>Commercialization of Seaweed mariculture in the south coast of Kenya has been successfully achieved. Since 2010, Seaweed farmers have farmed seaweed for commercial purposes thereby contributing to community-driven sustainable blue economy. The success in commercialization of seaweed was contributed by the high demand for seaweed products in the international market, scientific guidance into farming the development of the venture, good support from the county and national government and non-government actors (NGO) and a willing community of farmers in the Southcoast of Kenya. This work highlights at the successes achieved in commercial seaweed farming in the South Coast of Kenya. We highlight the challenges and discuss the overall contribution of commercial seaweed farming in Kenya. Further we highlight the missteps and challenge the methodology applied by the various stakeholders in their contribution to develop seaweed commercialization. We also report on the results from analyzing a sixteen years seaweed production and sales data from Kibuyuni and use the results to initiate a discussion on the need of a change of strategy by all stakeholders. </p>',
