    content:
      '<p>ASSESSEMENT OF PHYTOPLANKTON<strong> </strong>QUOTIENTS IN KISUMU BAY, NYANZA GULF, LAKE VICTORIA</p><p><strong>By </strong>Babu, J. M,<sup> 1</sup> Okechi J.K, Nyamweya C. N<sup>1</sup>, Mwamburi J.B.<sup>3</sup>, Sitoki L. M<sup>2</sup></p><p><em><sup>1</sup>Kenya Marine and Fisheries Research Institute, PO Box 1881, Kisumu, Kenya</em></p><p><em><sup>2</sup>The Technical University of Kenya, P.O. Box 52428-00200, Nairobi</em></p><p><strong><em>Author for correspondence </em></strong><a href="mailto:miruka2002@yahoo.com">miruka2002@yahoo.com</a></p><p>Abstract</p><p>Kisumu Bay is impacted by anthropogenic activities such as wetland reclamation, increased water pollution from domestic and industrial wastes, fertilizer runoff from the agro-based farms and sediment discharge through the rivers. This has resulted in significant changes in the trophic state and ecology of the bay, impacting negatively on water quality, fisheries and livelihoods of the people. Changes on water quality were monitored on a monthly basis from September 2019 to January 2020. Physico-chemical parameters (turbidity, temperature, conductivity, alkalinity, dissolved and suspended solids, and dissolved oxygen concentration) were measured. Chlorophyll<em>a</em> and phytoplankton<em> </em>analyses were done by spectrophotometric and microscopy techniques respectively. There were significant spatial differences in the dissolved oxygen concentrations (p&lt;0.0001) within the bay. These differences were pronounced at the Kisat, Maboko and Yatch stations. The differences were associated with discharge from Kisumu town. Chlorophyll<em>a</em> concentrations were found to be higher during the dry season compared to the rainy season. This could be attributed to high turbidity during the rainy season which reduces light penetration into the water column. Cyanophyceae (60 %), family was the most abundant group followed by Chlorophyceae (28%), Desmidaceae (11%), Bacillariophyceae family (7 %) and Euglenophyceae (1%). Among the Cyanophyceae, the most dominant species were <em>Microcystis</em> sp., <em>Chroococcus </em>sp., <em>Anabaena</em> sp and <em>Cylindrospermopsis </em>sp. Significant differences in distribution patterns in phytoplankton were observed between the offshore (Maboko) and inshore stations.Phytoplankton quotient (PQ) value was estimated at 4.1±0.26 indicating that the bay is highly eutrophic. </p><p>Keywords: <em>Phytoplankton abundance, physicochemical, water quality.</em></p>',
