    content:
      '<p><strong>Fluctuations in the concentration of cyanobacteria blooms and their socio-economic impact on the small fish traders of Lake Victoria’s Dunga and Homabay Beaches, Kenya</strong></p><p><em>D. Were<sup>1</sup>, K. Otiso<sup>2</sup>, C. Ongore<sup>3</sup>, H. Okeyo<sup>3</sup></em></p><p><em><sup>1</sup>Kenya Marine and Fisheries Research Institute P.O. Box 1881-40100, Kisumu, Kenya.</em></p><p><em><sup>2</sup>Bowling Green State University, Bowling Green, OH, USA.</em></p><p><em><sup>3</sup>Pelagic Ecology Research Group, Scottish Oceans Institute, Gatty Marine Laboratory, University of St Andrews, UK</em></p><p><a id="_Hlk159878235"></a>Lake Victoria’s Harmful Algal Blooms (HABs) pose significant socio-economic challenges, including the production of dangerous toxins, depletion of fish stocks, increased water treatment costs, and other detrimental effects on industries that are reliant on clean water. This study, which is based on survey data from July 2022, sought to assess local stakeholders\' understanding of HABs and their impacts on the lake\'s fisheries, water costs, and food security. Preliminary findings indicate that respondents possess varying levels of knowledge regarding HABs and their causes, suggesting divergent perspectives on potential mitigation strategies. The majority of respondents demonstrated familiarity with HABs and recognized their adverse impacts on water quality and ecosystem health. While respondents identified factors such as nutrient pollution and climate change as contributing to HABs, opinions diverged on the most effective strategies for addressing these underlying causes. Respondents acknowledged the detrimental effects of HABs on fish populations, citing reduced catch yields, economic losses for fishing communities, and water contamination. The study highlighted concerns about escalating water treatment costs due to HAB contamination; costs that negatively impact the finances of residents and utilities. HAB-related disruptions to fish stocks and water quality raise many concerns about local food security particularly for communities that are reliant on fishing as a primary source of nutrition and income. Water tests using ELISA test kits show that the observed variability in microcystin concentrations across different sampling sites show that the distribution of cyanobacterial blooms and toxin levels are not uniform throughout the study sites. Rather, microcystin concentrations varied across sampled sites ranged from nondetectable levels to 1.34 ug/L and averaged 0.149 ug/L. Sites with elevated microcystin levels present immediate threats to the health and well-being of the aquatic organisms inhabiting those areas. Exposure to high concentrations of microcistys can lead to acute toxicity that can affect the survival, growth, and reproduction of aquatic life. The health of downstream human and livestock consumers of the Lake’s water and fish can also be negatively impacted.</p><p><strong>Keywords: HABs, cyanobacteria bloom, socio-economic impact of HABS, Lake Victoria, Homabay and Dunga beach, Kenya</strong></p>',
