    content:
      '<h1><a id="_Toc152761218"></a>Distribution of Aquatic Macrophytes and other Invasive weeds and their impact on the fisheries of Lake Naivasha</h1><p>Edna Kerubo waithaka</p><p>Kenya Marine and Fisheries Research Institute</p><h1>ABSTRACT</h1><p>Exotic aliens, <em>Salvinia molesta </em>(floating water fern) and <em>Eichhornia crassipes </em>(water hyacinth) encroachment in Lake Naivasha are associated with deteriorating water conditions. This Paper aims to assess the distribution and quantification of macrophyte population in Lake Naivasha between July 2022 and June 2023. High-resolution optical Earth Observation (EO) data and in-situ data were used to assess the extent and quantify the macrophytes and other Aquatic invasive weeds in lake Naivasha, Kenya.  Normalized Difference Vegetation Index (NDVI) was used to estimate the area under vegetation using multidate images 2022 and 2023.  The overall findings indicate that the coverage remained relatively stable to the North of Lake Naivasha, around the Malewa river delta, Korongo and Oserian Bay.<em> Salvinia molesta </em>(Floating Water Fern), <em>Eichhornia crassipes </em>(Water Hyacinth) and many semi-aquatic species of grasses and sedges were the most dominant while <em>Cyperus papyrus </em>(Papyrus) population was on the decline.  Concerted efforts by the county government of Nakuru, ministry of environment and the National Environmental Management Authority (NEMA) need to be put in place to restore this critical macrophytes</p><p><strong>Key words: Earth observation, Macrophytes, Water hyacinth, papyrus, distribution, coverage</strong></p>',
