    content:
      '<p><strong>Stock assessment of </strong><a id="_Hlk104471871"></a><strong><em>Lutjanus fulviflamma</em> (Forsskål, 1775) along the Kenyan Coast to inform its management</strong></p><p>J. M. Nyamora<sup>1,2</sup>, E. K. Mbaru<sup>1</sup>, K. Nyakeya<sup>2,3</sup>, E. Fondo<sup>1</sup>, G. M. Okemwa<sup>1</sup>, E. Kimani<sup>1</sup>, T. K. Mkare<sup>1</sup>, E. M. Mulwa<sup>1</sup>, F. Mzingirwa<sup>1</sup>, M. B. Ontomwa<sup>1</sup>, A. A. Athman<sup>1</sup>, J. Mwangata<sup>1</sup>, B. Orembo1, G. Odhiambo<sup>1</sup>, I. Nimrod<sup>1</sup> and N. Wambiji<sup>1</sup></p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute (KMFRI), Mombasa Station, P.O. Box 81651, Mombasa, Kenya.</p><p><sup>2</sup>Kisii University, School of Agriculture, P.O. Box 408, Kisii, Kenya</p><p><sup>3</sup>Kenya Marine and Fisheries Research Institute (KMFRI), Baringo Station, P.O. Box 231, Marigat, Kenya.</p><p><strong>Corresponding author: </strong><a href="mailto:janenyamora8@gmail.com"><strong>janenyamora8@gmail.com</strong></a></p><p><strong>Focus Area: </strong>Interdisciplinary Research (Oral Presentation)</p><p><strong>Abstract </strong></p><p>Demersal reef fisheries are important for food security among the Kenyan coastal communities but, there exists data paucity on this fishery. This study determined the stock status of <em>Lutjanus fulviflamma</em> (one of the demersal reef fisheries) to inform the management on its sustainable exploitation rate. Data collected from artisanal fishers along the Kenya coastline between the year 2001 and 2023 was used. The total length (TL) of fish was measured in cm right from the tip of the mouth to the caudal end while weight was measured using a digital weighing machine. Length-based indicators (LBI) were used in calculating the proportion of mature fish and mega-spawners in the catch. The growth parameters: L∞, K, Rn and ta were estimated from ELEFAN (TropfishR) length modal progression. Total mortality, natural mortality, fishing mortality and Exploitation rate on the other hand were derived from catch curve analysis using the ELEFAN_GA function; and length weight relationship was computed as W = a L<sup>b</sup>. A total of 7256 individuals were sampled and their TL varied between 9 and 45 cm with a mean of 19.1 cm. Results for  L∞, K, Rn and ta were estimated at: 36.36 cm, 0.303, 0.09 and 0.26 respectively whereas total mortality, natural mortality, fishing mortality and exploitation rate was found to be; 1.36, 0.605, 0.78 and 0.444 respectively. Exploitation rate was below the maximum sustainable yield (0.444), an indication of under-exploitation. As much as we recommend for more exploitation of the fishery for improved food security, job creation, enhanced income and poverty eradication, there is need to regulate mesh sizes for sustainable exploitation. We also recommend on long term monitoring to provide trends over time to gauge the performance of the fishery for conservation and management.</p><ul><li><strong>Key words</strong>: <em>Marine fisheries; sustainable exploitation, biodiversity conservation; stock assessment; and population dynamics</em></li></ul>',
