    content:
      '<p><strong>Endemic Lake Baringo </strong><em>Oreochromis niloticus </em><strong>fishery on verge of collapse: Review of causes and strategies towards its recovery, conservation and management for sustainable exploitation</strong></p><p>Kobingi Nyakeya<sup>1,2*,</sup> Jane Moraa Nyamora<sup>2,3</sup>, Frank Onderi Masese<sup>4</sup>, Gilbert Atuga<sup>3</sup>, Zipporah Gichana<sup>2</sup>, Cyprian Ogombe1 Odoli<sup>1</sup>, James Onchieku<sup>2</sup>, Albert Getabu<sup>2</sup>, and James Njiru<sup>2</sup></p><p><a id="_heading=h.gjdgxs"></a>1Kenya Marine and Fisheries Research Institute (KMFRI), Baringo Station, P.O. Box 231, Marigat, Kenya.</p><p>2Kisii University, School of Agriculture, P.O. Box 408, Kisii, Kenya</p><p>3Kenya Marine and Fisheries Research Institute (KMFRI), Mombasa Station, P.O. Box 81651, Mombasa, Kenya.</p><p>4Department of Fisheries and Aquatic Sciences, University of Eldoret, Eldoret, Kenya </p><p>*Corresponding author: <a href="mailto:kobinginyakeya@gmail.com">kobinginyakeya@gmail.com</a></p><p><strong>Focus Area: </strong>Fisheries and Aquaculture (Oral)</p><p><strong>Abstract </strong></p><p>Lake Baringo, a Ramsar-designated water body faces myriad environmental challenges attributable to anthropogenic activities. It is not only important at the local level, but also internationally because of its rich biodiversity thus a tourists destination. It supports an artisanal fishery of four fish species namely: <em>Oreochromis niloticus</em>, <em>Protopterus aethiopicus</em>, <em>Clarias gariepinus </em>and <em>Labeobarbus intermidus</em>. The once vibrant <em>O. niloticus </em>fishery is no longer sustainable. It<em> </em>contributed over 80% of the landed catch up to the year 2002, averaging &gt;600 tons annually, but dwindled to 12 tons by the year 2006. The introduced <em>P. aethiopicus </em>represents more than 75% of the fish landings, surpassing <em>O</em>. <em>niloticus </em>that lands just 1%. Although <em>O</em>. <em>niloticus </em>is listed as ‘endangered’ in the IUCN Red List of Endangered Species, its fishery may collapse if sound management strategies are not implemented. Accordingly, the present study reviewed past studies on <em>O</em>. <em>niloticus </em>fishery and critically analysed the possible reasons for its decline as well as possible strategies directed to its recovery, conservation and management for sustainable exploitation. Some of the threats include: overfishing, increased effort, climate change, pollution, relaxed laws/regulations, and fishing inside demarcated/breeding areas. We recommend for the implementation of such strategic interventions as: integrated management of the catchments, policy implementation, mapping and demarcation of nursery/breeding grounds, closed seasons, and well-coordinated and concerted efforts by both national and county governments for sustainable conservation and management of <em>O. niloticus</em> fishery.</p><p><strong>KEYWORDS: </strong>Conservation and management, Lake Baringo, <em>Oreochromis niloticus </em>fishery, overexploitation, sustainable exploitation </p>',
