    path: 'dox/Sustainable Fisheries and Aquaculture/POSTER/emergence of enzootic infestations in the cage culture systems of o_ niloticus in the northern and s.pdf',
    content:
      '<p><strong>Emergence of Enzootic infestations in the cage culture systems of <em>O. niloticus</em> in the Northern and Southern parts of the Lake Victoria Kenya.</strong></p><p><strong>Caleb Ogwai, Mwainge, V., Aura, Meshack Mayienda and Nathan Kemei.</strong></p><p>Kenya Marine and Fisheries Research Institute, Kisumu Center.</p><p>P. O.Box 1881 Kisumu 40100</p><p><strong>Fish mortalities have occurred in Lake Victoria in the recent past. During these incidences we sought to examine the status of both the carcasses and the dying fish in selected cages in the five riparian counties of Kisumu, Siaya, Homabay,  Migori and Busia of Lake Victoria, Kenya for a period of 24 months from June 2021 to July 2023. Necropsy and parasitological evaluation were performed followed by identification of the isolated parasites. High prevalence of infestation by <em>L. cyprinacea</em>; 40% to 50% respectively was recorded in the cages of the Northern and Southern waters during mortalities.  Transmission was suspected to be through the introduction of infected fishes or by the water supply or movements through currents. The average Temperature of 26<sup>0</sup>C and pH range of 6.9-7.5 recorded in the North and 26.4<sup>0</sup>C and pH range of 8.4-8.5 recorded in the South is ideal for the transmission the parasites. Excessive mucous production from the skin, fins and gills originating from irritation was common and the surfaces and or areas of attachment were often hemorrhagic with excessive red blood cells. The parasites additionally opens portals for a variety of opportunistic pathogens and vectors for haemoprotozoans, bacteria, fungus and viruses some of which may be zoonotic. Lastly, fishes that are recovering or have completely recovered from crustacean copepod parasites infestations were thought to be somewhat immune to a second or further attacks.</strong></p><p><strong>Key words: Transmission, Infestations, Fish mortalities, Cages, <em>O, niloticus</em>.</strong></p>',
