    path: 'dox/Sustainable Fisheries and Aquaculture/ORAL/exploring fishery potential in small water bodies_ nakuru and  narok counties.pdf',
    content:
      '<p><strong>Exploring Fishery Potential in Small Water Bodies: Nakuru and  Narok Counties</strong></p><p><a id="_heading=h.gjdgxs"></a></p><p>Mutie AM <sup>*1</sup>, Waithaka E<sup>1</sup>, Morara GN<sup>1</sup>, Loki P<sup>1</sup>, and Obegi B<sup>1</sup></p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute, P.O Box 837- 20117, Naivasha, Kenya</p><p>*Corresponding author’s email address: <a href="mailto:amutie@kmfri.go.ke">amutie@kmfri.go.ke</a></p><p>The objective of this study was to assess the fishery potential of small water bodies (SWBs), Lake Solai, and Kenyatta Dam within Nakuru County, as well as Melelo and Kikuyian Dams in Narok County. This assessment incorporated fisheries, the environmental characteristics of SWBs, and socioeconomic aspects of neighboring communities. Notable variations in water quality parameters were observed among the SWBs, with Kenyatta Dam notably registering lower temperatures (&lt;17°C) than the other three water bodies. Dissolved oxygen levels, consistently remained above 5 mg. L<sup>-1</sup> across all SWBs. However, it\'s worth noting that Lake Solai exhibited elevated conductivity (4246.14±86 µs.cm<sup>-1</sup>) and salinity (2.60 ppt) levels. Additionally, all SWBs except for Kenyatta Dam indicated fecal coliform contamination. In terms of fish catch, Lake Solai yielded 36 fish, comprising 24 <em>Clarias gariepinus</em> (Catfish) and 12 <em>Oreochromis niloticus</em> (Nile tilapia), with an estimated catch rate of 9 fish.hr<sup>-1</sup>. The mean size of catfish was 46.88±5.6 cm and that of Nile tilapia was 24.16±6.6 cm. Kenyatta Dam exhibited a lower catch rate of 3 fish.hr<sup>-1</sup>, with <em>O. niloticus</em> mean size of 23.53±5.50 cm. No fish was caught in Kikuyian Dam during the sampling period. Melelo Dam demonstrated a comparatively higher catch rate of 14 fish.h<sup>-1</sup> compared with the three SWBs, with mean sizes of 30.41±10.12 cm and 23.21±6.2 cm for <em>C. gariepinus</em> and <em>O. niloticus</em>, respectively. Fish yield estimates varied, with Lake Solai having the highest at 548.3 t. yr<sup>-1</sup>, while Kenyatta Dam had the lowest at 4.8 t.yr<sup>-1</sup>. The communities had a positive perception of fishery development and were interested in being trained in various aspects of fisheries. They recommended tilapia and catfish species to be restocked. Some of the cited challenges that would hinder fishery development in these areas were a lack of market, limited knowledge of fishing gear and methods, and cultural barriers. Overall, these SWBs exhibit significant potential for supporting fish growth and production. However, realizing this potential requires a concerted effort towards monitoring and ensuring sustainability.</p><p><strong>Keywords: </strong>Fish catch, Fishery potential, SWBs, Water quality</p>',
