    title:
      'The Abundance And Diversity Of Macroinvertebrates In Relation To Water Quality: A Case Study Of Kisumu Bay',
    author: 'Sharon A. Miniga',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'sharon.miniga@gmail.com',
    presentation_mode: 'Poster',
