    title:
      'Impact of cage aquaculture on limnology, biodiversity and food security in Lake Victoria -Kenya',
    author: 'John Okechi',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'jokechi1263jk@gmail.com',
    presentation_mode: 'Oral',
