    content:
      '<h1>Growth pattern and stock assessment of Pink ear emperor <em>Lethrinus lentjan </em>(<a href="http://en.wikipedia.org/wiki/Bernard_Germain_de_Lac%C3%A9p%C3%A8de&quot; \\t &quot;_blank&quot; \\o &quot;Wiki">Lacepède</a>, <a href="http://researcharchive.calacademy.org/research/ichthyology/catalog/getref.asp?id=4929" target="_blank">1802</a>) (Actinopteri, Lethrinidae) from Kenya coral reefs</h1><p>Hafidh Ishmail Otieno</p><p>Kenya Marine and Fisheries Research Institute</p><p>A total of 7,296 random specimens of <em>Lethrinus lentijan</em> were collected from across 31 fish landing sites from 2002 to 2022. This study aims to investigate the growth pattern and stock assessment of this common reef species in Kenya. Results showed that the catch of <em>L. lentjan </em>varied in lengths between 2.0 cm and 72.0 cm total length. The value of ‘‘b” for the length-weight relationship reflected a negative allometric growth for the combined sex. Seven cohort groups representing 7 yr were identified by Bhattacharya’s method. The growth parameters were L∞ = 74.4 cm and K = 0.77. The study of fishery parameters revealed that <em>L. letjan</em> population was overexploited (E<sub>cur. </sub>= 0.77). Further studies are recommended to shed lights on its spawning, reproductive biology and nursery grounds in the Kenyan waters. </p>',
