    title:
      'Fatty Acid Composition Of Catfish Fed On Black Soldier Fly Larvae Formulated Diets Under Aquaponic System',
    author: 'Benard Omboga Maranga',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'marangabenard@gmail.com',
    presentation_mode: 'Oral',
    recommendation: 'Oral',
    status: 'Sent',
    path: 'dox/Sustainable Fisheries and Aquaculture/ORAL/fatty acid composition of catfish fed on black soldier fly larvae formulated diets under aquaponic s.pdf',
    content:
      '<p><a id="_Hlk74595072"></a><strong>FATTY ACID COMPOSITION OF </strong><a id="_Hlk74595091"></a><strong>CATFISH FED ON BLACK SOLDIER FLY LARVAE FORMULATED DIETS UNDER AQUAPONIC SYSTEM  </strong></p><p><a id="_Hlk80187890"></a>Benard Omboga Maranga <sup>1,3*</sup>, Kelvin M. Omolo<sup>2</sup>, Robert N. Kagali<sup>1</sup>, Paul O. Sagwe<sup>4</sup> <a id="_Hlk80187965"></a></p><ol><li>Department of Zoology, Jomo Kenyatta University of Agriculture and Technology, P. O. Box 62000-00200, City Square, Nairobi, Kenya</li><li>Department of Biochemistry, Jomo Kenyatta University of Agriculture and Technology, P. O. Box 62000-00200, City Square, Nairobi, Kenya</li><li>Sagana Aquaculture Centre, Kenya Marine and Fisheries Research Institute, P. O. Box 451- 10230, Sagana, Kenya</li><li>Kegati Aquaculture Centre, Kenya Marine and Fisheries Research Institute, P.O. Box 3259-40200, Kisii, Kenya</li></ol><p>Corresponding Author: marangabenard@gmail.com</p><p><strong>Abstract  </strong></p><p>Replacement of FM with BSFL has enhanced aquaculture development by significantly reducing cost of production while increasing productivity. However, effects on nutritive value of fish fed on BSFL formulated diets have to be maintained at accepted levels to ensure nutritional benefits to consumers. A 120-day feeding trial was conducted at a fish farm in Baringo County, Kenya to evaluate the effect of partial replacement of FM with black soldier fly larvae (BSFL) fatty acid composition of catfish. Three, 35% crude proteins content test diets were formulated with BSFL replacing FM at (25, 50 and 75) % and tested using commercial diet. A total of 12 tanks were divided into 4 treatments and stocked at a density of 50 catfish per tank weighing (5.6±0.5) g. Whole body, liver and muscles tissues obtained from catfish fed on diets containing BSFL were analysed using gas chromatography in the laboratory. The results showed inclusion of BSFL at different rates in diets contributed to fatty acids composition in fish tissues. The summation of saturated and unsaturated fatty acids analyzed varied significantly (p&lt;0.05) among the diets and fish tissues. Palmitic, oleic and linolenic were dominant saturated, monounsaturated and polyunsaturated fatty acids obtained for diets and fish tissues respectively. Docosahexaenoic acid (DHA) was the dominant omega-3 fatty acid in fish tissues with liver having significantly higher accumulation than whole body and muscle tissues. Saturated fatty acids on catfish tissues increased while unsaturated fatty acids concentration decreased with increasing replacement of BSFL in diets. Highest concentration <a id="_Hlk111535571"></a>of saturated and unsaturated acids in tissues were obtained for 75% and 25% <a id="_Hlk111535656"></a>BSFL replacement in diets respectively. The study showed that BSFL can replace fishmeal in diet without affecting the nutritional quality of catfish flesh. Thus, BSFL is sustainable and economical protein ingredient for catfish feed formulation.  </p><p><strong>Key Words:</strong> Aquaponics, Formulated diets, Black soldier fly, Catfish, Fatty-Acid composition</p>',
