    presentation_mode: 'Oral',
    recommendation: 'Oral',
    status: 'Sent',
    path: 'dox/Sustainable Fisheries and Aquaculture/ORAL/arbec ii abstract  the fishery of lake turkana_ are there hidden drivers of production and markets_.pdf',
    content:
      '<p><strong>ARBEC II ABSTRACT</strong></p><p><strong>The Fishery of Lake Turkana: Are there hidden drivers of production and markets?</strong></p><p>John Malala¹, Casianes Olilo¹, Maurice Obiero¹, Chadwick Bironga¹, Kevin Obiero<sup>2</sup>, Erick Ogello<sup>3</sup>, Jonathan Ekiru<sup>1</sup>, David Namwaya<sup>4</sup>, Joseph <sup>5</sup>Kasuti, Crispin Nyamweya<sup>6</sup>, Christopher Aura<sup>6</sup>, James Njiru<sup>7</sup></p><p>¹Kenya Marine and Fisheries Research Institute, Lodwar, Kenya</p><p>²Kenya Marine and Fisheries Research Institute, Sangoro Aquaculture Centre, Pap-Onditi, Kenya</p><p><sup>3</sup>Maseno University, Maseno, Kenya</p><p><sup>4</sup>State Department of Blue Economy, Turkana, Kenya</p><p><sup>5</sup>Kenya Fisheries Service, Lake Turkana, Kenya</p><p><sup>6</sup>Kenya Marine and Fisheries Research Institute, Kisumu, Kenya </p><p><sup>7</sup>Kenya Marine and Fisheries Research Institute, Mombasa, Kenya </p><p>Lake Turkana, the largest waterbody in Kenya produces a paltry 4% of the total fish landings from the total production realized from inland fresh water systems. Endowed with popular fish species such as <em>Lates niloticus</em> (L), <em>Oreochromis niloticus</em> (L), and <em>Clarias gariepinus</em> (L) amongst others, the production has stagnated over the years with various factors being suggested as responsible. In the last 6 years, recorded total production has been steadily increasing almost reaching half of the predicted potential. While this is a positive sign, factors responsible for this have not been clearly understood thus causing challenges in making informed management decisions. To address this gap we undertook a study anchored on the three critical nodes of the fish value chain, looked at the past and current trends in the fishery and considered a number of traditional and emerging issues that drive the fishery. Data was collected using a combination of stakeholder surveys, analysis of national production statistics and results of two catch assessment surveys undertaken in the lake. Results indicate a fishery which is unpredictable, driven by combination of complex intertwining factors related to hydrography, poverty, tradition, internal and external forces, amongst other critical forces. Some drivers appeared hidden, and must be understood such that management planning be centered around them for effectivity. The study suggests a number of management regimes which if well addressed will enable the realization of the maximum potential of Lake Turkana fishery and cement its contribution as a critical pillar of blue growth of Lake Turkana </p><p><strong>Key words:</strong>  water level fluctuation, Catch assessment, fish production, climate change, subsidies and illegal, unreported and unregulated fishing.</p><p><strong>Theme:</strong> Sustainable Fisheries and Aquaculture</p><p>The fishery of Lake Turkana is highly dispersed and fish landings, processing and trade take place anywhere along the expansive shoreline. • In 2020 13,140 metric tonnes of fish valued at 1.18 billion Kenya shillings was landed by an estimated 10,000 fishers plying the lake in approximately 7,000 fishing vessels and supporting livelihoods of over 300,000 people. • Comparatively, in 2021, 14,667 metric tonnes of fish with an ex-vessel value of 1,023 billion Kenya shillings was landed from Lake Turkana.</p>',
