    content:
      '<p><strong>An analysis of the diversity and prevalence of parasites of <em>Clarias gariepinus</em> in 2 rivers linked with pollution from domestic effluents</strong></p><p>Mwainge, V. <a id="_Hlk146624753"></a><sup>a</sup> *, Ogwai, C<sup> a</sup>., Wandoe, S.<sup>b</sup> , Abich, E. <sup>a</sup>.</p><p>a Kenya Marine and Fisheries Research Institute, P.O. Box 1881 – 40100, Kisumu, Kenya.</p><p>b Pwani University P.O. Box 195 -80108, Kilifi, Kenya </p><p><br /></p><p>*<strong>Corresponding author: venny.mziri@yahoo.com</strong></p><p><strong>ABSTRACT</strong></p><p>Catfish (<em>Clarias gariepinus</em>) is said to harbor lots of parasites due to their feeding habits and their ability to exist and flourish in poorly oxygenated waters/ and nutrient rich environments. This study was conducted in 2021 in 2 rivers that are associated with pollution emanating from domestic effluents that are not fully processed to assess the parasite diversity of the 2 sites. Samples were collected in 2021 from Rivers Auji and R. Kisat at about 100 meters from the site the rivers connect to Lake Victoria. 68 species of  <em>C. gariepinus</em> were collected and preserved for dissection in the laboratory. The samples were between 38g and 550g and of a length between 13.6cm to 47.2cm. While in the laboratory, standard protocols and procedures were used in the dissection, storage and identification of the parasites. The study found 5 different species of parasites in R. Auji (<em>Camallanus laevionchus</em>, Flukes, <em>Clinostomum</em>, <em>Contracaecum</em> and Black spot(Neascus)) and 5 species in R.Kisat (<em>Camallanus laevionchus</em>, Flukes, <em>Contracaecum</em>, Black spot(Neascus) and <em>Clinostomum</em>. Nematodes of the genus <em>Camallanus laevionchus</em> had the highest prevalence in R. Auji at 37.84% while trematodes  had the highest prevalence in R.Asat at 32.26%. The average relative condition factor for the <em>C.gariepinus</em> in R. Auji was 0.9 while that for  the same species in R. Kisat was 1.1.  The study identified parasites of zoonotic significance implying a need for further study to establish the risk factors and further advise the resource users.</p><p><strong>Keywords</strong>: <em>Clarias gariepinus, </em>parasites, Diversity, prevalence, Zoonotic</p>',
