    content:
      '<p><strong>Length-weight relationship and condition factor of selected Major fish species in Mombasa County, Kenya</strong><em> </em></p><p>A. C. Mkombola<sup>*1</sup> ; A.M. Getabu <sup>*2</sup> </p><p>State Department of Fisheries and Blue Economy, Coast Region, P.O Box 90423-80100, Liwatoni Road Mombasa, Kenya, <em>cmkombola@gmail.com<sup>1</sup>;</em> Faculty of Agriculture and Natural Resources Management, Kisii University, P.O. Box 408 - 40200 Kisii, Kenya,<em> kisiiuniversity.ac.ke<sup>2</sup></em></p><p><strong><em>Keywords: length-weight relationship, relative condition factor, stock assessment, Kenyan Coast </em></strong></p><p><strong>Abstract</strong></p><p>Small-scale fisheries along the Kenyan Coast is increasingly growing under threat creating the need to monitor the fishing and population dynamics of highly targeted species. The study was aimed at determining the length weight and condition parameters for major fishes in Mombasa County. Samples were collected randomly from fishermen using different gears including gillnets, basket traps and hand line, at different selected landing sites within Mombasa County from July to November 2022. Data from 456 fish samples of about 30 species was recorded. However the catches were dominated by four species i.e. <em>Siganus suitor</em> (Valenciennes, 1835), <em>Lethrinus lentjan </em>(Forsskal, 1775), <em>Lethrinus nebulosus</em> (Forsskal, 1775) and <em>Leptoscarus vaigiensis</em> (Quoy &amp; Gaimard, 1824) whose length weight relationship and condition factor were determined. Length frequency data showed that <em>Siganus suitor</em> was the most dominant contributing to 44.9 percent with the remaining three species accounting for 23 percent of the fish catch. <em>Siganus suitor, Leptoscarus vaigeinsis, Lethrinus lentjan</em> and <em>Lethrinus nebulosus</em> had a b value of 1.24, 2.74, 2.78 and 2.62 respectively indicating negative allometric growth for all the species. Condition factor K was calculated at about 1.0 for all the four species indicating relatively good health and availability of food resources in their habitat. This study will be useful in comparing landing trends, gear selectivity and seasonal variations of fish species. </p>',
