    path: 'dox/Community Engagement and Inclusivity/ORAL/the role of educational systems as a community centred initiative in restoring marine ecosystem_ a c.pdf',
    content:
      "<p><strong>The Role of Educational Systems as a Community Centred Initiative in Restoring Marine Ecosystem: A Case Study of Mbita Beach </strong></p><p>Violet Atieno, Ochieng Mary Mercy, Dr. Gabriel O. Ng'ong'a, Anne Auma Ogwari</p><p>Affiliation</p><p>Bondo Technical Training Institute (BTTI) P.O Box 377-40601, Bondo Kenya</p><p>Corresponding Author <strong>Gabriel O. Ng’ong’a</strong>: Email: gabngonga@yahoo.com</p><p><strong>Abstract </strong></p><p>Marine pollution has been a heightening danger for several decades in Kenya. This has been due to social, ecological and economic impacts. The aquatic environment has suffered momentous issues of pollution due to; oil spillage, plastic debris washed in the shore line, domestic wastes, illegal fishing. Despite the fact that Kenya has undertaken a collaborative approach; like MARPOL of 1994, Kenya Constitution 2010 to ensure safe and clean environment, the National Marine Litter Management Authority still reports that by 2030 the action plan on the national strategies for waste management in the water bodies could be executed. This postulates that achieving clean and healthy ecosystem remains an unfulfilled dream. This research hence examined the role of educational systems as a community centered initiative in restoring marine ecosystem in Mbita Beach. Enlightening communities on initiatives like use of scientific methods of beach cleaning, controlled use of agricultural chemicals and proper disposal of plastics to restore marine ecosystems helps in ensuring best practices for a sustainable blue economy. The study employed cross-sectional survey, where data was collected through structured questioners among 300 people living around Mbita Beach. Data analysis was done using IBM SPSS software version 25.0. Descriptive statistics was used to analyze the effects of domestic and industrial wastes on water body whereas the relationship between these factors and aquatic life was established by Chi-square (χ2) tests. A greater portion (81.2%) of Mbita residents acknowledged that they were uninformed on the impact of domestic and industrial waste on marine environment as compared to (19.8) who had basic information on the same. This study reveals that unawareness of the impact of waste on marine ecosystem is a major contributing factor to water pollution. Consequently, educational systems should emphasize on training the community on consequences of wastes on marine ecosystems. </p><p><strong>Keywords</strong>: marine ecosystem, educational system, community centred, water pollution</p>",
