    content:
      "<p><strong>Variabilities in distribution, composition, and abundance of zooplankton in open bays and closed embayment of Lake Victoria's Winam Gulf, Kenya</strong></p><p><em>D. Were<sup>1</sup>*, R. Omondi<sup>2</sup>, C. Ongore<sup>1</sup>,<sup>3</sup>, H. Okeyo<sup>1</sup>, J. Achiya<sup>1</sup>, M. Owilli<sup>2</sup>, M. Moseti<sup>2</sup></em></p><p><em><sup>1</sup>Kenya Marine and Fisheries Research Institute P.O. Box 1881-40100, Kisumu, Kenya.</em></p><p><em><sup>2</sup>Department of Fisheries and Aquaculture, Kisii University</em></p><p><em><sup>3</sup>Pelagic Ecology Research Group, Scottish Oceans Institute, Gatty Marine Laboratory, University of St Andrews, UK</em></p><p>The Winam Gulf, a closed embayment within Lake Victoria, has borne the brunt of diverse water quality compromising pollutants, affecting the delicate balance of aquatic ecology in the world's second largest freshwater lake. Zooplankton, critical to aquatic ecosystem trophic dynamics, are important in energy transfer and nutrient cycling in Lake Victoria's Winam Gulf. This study used the zooplankton ecological model to assess ecosystem health driven productivity in the gulf by making comparisons between spatial patterns in open bays and closed embayment.  From 2022 to 2023, meticulous sampling involving vertical depth profile hauls was conducted in 19 locations. Physicochemical parameters were instrument logged in-situ using a multiparameter probe. Preliminary results show that closed embayment and open bay habitats exhibit variabilities in physicochemical parameters and zooplankton abundances. The mean (± SE) physicochemical parameters recorded in closed bays were dissolved oxygen 4.12 ± 0.42 mg/L; pH 7.88 ± 0.31; ORP -120.03 ± 9.28 mV; salinity 0.052 ± 0.001 ppt; and conductivity 142.11 ± 1.34 µS/cm. In contrast, open bays exhibited slightly narrower ranges of; dissolved oxygen 3.89 ± 0.62 mg/L; pH 7.95 ± 0.51; ORP -121.18 ± 7.56 mV; salinity 0.054 ± 0.002 ppt; and conductivity 140.25 ± 0.89 µS/cm. On the other hand, the mean (± SE) zooplankton abundances (individuals/L) in closed bays were higher (rotifers 31 ± 5; copepods 193 ± 7; and Cladocera 50 ± 3), compared to open bays where the mean (± SE) for (rotifers 2 ± 1; copepods 95 ± 10; Cladocera 5 ± 2).  Copepods emerged as the dominant group across both habitats, indicating their widespread prevalence, indicating historical timespan shifts in zooplankton diversity. Observed potential variabilities between physicochemical parameters and zooplankton population indices suggest that closed bay habitats offer more favourable conditions for zooplankton productivity, hence a useful inference for focused ecosystem management approaches.</p><p><strong>Keywords: Open bay, closed embayment, water quality, zooplankton community structure, aquatic ecosystem health.</strong></p>",
