    content:
      '<p><strong>Changes in Fish Weight During Processing: Implications for Estimation/reporting of Fish Production from Lake Turkana</strong></p><p>Jonathan Ekiru¹, John Malala¹, Maurice Obiero¹, Casianes Olilo¹, Chadwick Bironga¹, Kevin Obiero<sup>2</sup>, Erick Ogello<sup>3</sup></p><p>¹Kenya Marine and Fisheries Research Institute, Turkana Station, P.O. Box 205-30500, Lodwar, Kenya</p><p>²Kenya Marine and Fisheries Research Institute, Sangoro Aquaculture Centre, Pap-Onditi, Kenya</p><p><sup>3</sup>Maseno University, Maseno, Kenya</p><p><strong>ABSTRACT</strong></p><p>We undertook a study of 8 main commercially important fish species to determine weight losses as a result of sun drying from production to weighing of landings to inform correct reporting of estimates of fish production from Lake Turkana. This study was informed by the fact that over 75% of the production must be processed, salted and sundried before they can be recorded during delivery for sale and therefore possibly under-reports fresh weight production. Significant weight losses are encountered due to viscera removal, different degrees of sun drying, storage and handling. This is aggravated by the fact that most fish sales are widely done in pieces/numbers instead of by weight hence serious underestimation of production from the lake may result. In order to arrive at the best estimates of fresh fish production, weight measurements of fresh and sundried fish were made from commercial catches at various locations (fish landing beaches and fish stores) and fish caught from experimental sampling to estimate the quantity lost before delivery for sale and to establish the best conversion ratios from dry to fresh weight for each species. <em>Alestes baremose</em> (Silverside), <em>Oreochromis niloticus</em> (Tilapia), <em>Lates niloticus</em> (Nile perch), <em>Distichodus niloticus</em> (Cowfish), <em>Clarias gariepinus</em> (Mudfish), <em>Hydrocynus forskahlii </em>(Tiger fish), and<em> Bagrus bajad </em>(catfish) were selected for this study. Results indicate weight losses varied within and between species by sizes, by fish condition and the degree of preservation. The highest dry weight to fresh weight ratio ranged from 1:7.4-1:10.9 for the larger species such as Nile perch, catfish and mudfish, a factor we attributed to the unique way of their processing. For the rest of the species the ratios ranged from 1:2.2 to 1:4.7. Due ratio variations, we proposed a number of management measures including a consideration of these ratios in the final computation of the total fish landings at every beaches and that guidelines be provided to fishers, buyers and store owners where bulking is done. </p><p><strong>Key words:</strong>  Lake Turkana, weight conversions, fresh water fish and fishery</p><p><strong>Theme:</strong> Sustainable Fisheries and Aquaculture</p>',
