    content:
      '<p><strong>Coral gardening approach to reef restoration and its contribution to Aquarium aesthetic value.: A review</strong></p><p><strong><em>Correspondence author: Grace Nduku</em></strong></p><p><strong><em>Correspondence email:</em></strong> <a href="mailto:gracen.mutua@gmail.com">gracen.mutua@gmail.com</a> </p><p><strong>Abstract</strong></p><p>Coral reefs support high biodiversity and sustain reef-dependent communities, whereas degraded coral reefs, lose valuable coral reef ecosystem services. Coral reefs are vulnerable to anthropogenic pressures, including climate change, coastal development, land-based input of nutrients and sediments from agriculture, sea-based pollution, overfishing and destructive fishing practices. Coral gardening offers an alternative to wild harvest for the ornamental trade, reef restoration and preserving biodiversity. Coral gardening involves propagation both sexually and asexually <em>in-situ</em> and <em>ex-situ</em> mainly using branching coral species. Asexually, propagules are sourced from a donor coral colony are cut into smaller fragments and attached to artificial substrate. Sexually derived propagules are collected from the wild or from colonies in aquarium during spawning, with an artificial substrate provided for settlement. Simple and cost–effective propagation techniques can be used to restore degraded reefs, preserve endangered species, provide live corals to the international ornamental trade, enable livelihood diversification for coastal communities. Coral propagation methods have numerous environmental and social benefits in comparison to wild collections, including reducing anthropogenic impacts, preserving biodiversity, advancing scientific knowledge and improving trade. To make coral propagation commercially viable, a balance must be established between achieving maximum survivorship with limited operational costs. Coral gardening requires understanding biodiversity of the coral reef, gardening sites, and approach to be used. The steps to gardening include nursery setup, coral collections, nursery operations, and out-growing. Coral gardening can restore tourism to proximal reefs, increase biodiversity and provide more local food sources. The main factor for successful coral gardening is maximizing the coral survivorship and productivity during the nursery or grow-out stage by introducing numerous techniques. Global estimates indicate coral reefs contribute US$2.7 trillion per year in ecosystem service value, including US$36 billion in coral reef tourism as well as supporting at least 25% of marine species.</p><p> </p><p><strong>Key words: </strong>coral gardening, propagation, coral fragments</p>',
