      '<p><strong>TRUEFISH aquaculture water quality sampling program on Lake Victoria</strong></p><p>Stu Hamilton, Jonathan MacKay, Heidi Alleway</p><p>East Carolina University, The Nature Conservancy</p><p>HRBS-GLWNB 2020 presents the first open-source and high-resolution bathymetry, shoreline, and water level data for Lakes Victoria, Albert, Edward, and George in East Africa. For each Lake, these data have three primary products collected for this project. The bathymetric datasets were created from approximately 18 million acoustic soundings. Over 8,200 km of shorelines are delineated across the three lakes from high-resolution satellite systems and uncrewed aerial vehicles. Finally, these data are tied together by creating lake surface elevation models collected from GPS and altimeter measures. The data repository includes additional derived products, including surface areas, water volumes, shoreline lengths, lake elevation levels, and geodetic information. These data can be used to make allocation decisions regarding the freshwater resources within Africa, manage food resources on which many tens of millions of people rely, and help preserve the region’s endemic biodiversity. Finally, as these data are tied to globally consistent geodetic models, they can be used in future global and regional climate change models.</p>',
