    content:
      '<p><strong>Genetic diversity among farmed and wild Nile tilapia, <em>Oreochromis niloticus,</em> populations in Kenya and its significance for Aquaculture and Conservation </strong></p><p><strong>Authors: </strong>Jacob Abwao<sup>1* </sup>Joseph Junga<sup>2</sup>,<sup> </sup>James Barasa<sup>3</sup>, Dorcas Sigana<sup>4</sup>, Domitila Kyule<sup>1</sup> and Mary Opiyo<sup>1</sup> </p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute, Sagana Aquaculture station,451-10230 Kenya.</p><p><sup>2</sup>Department of Animal production, University of Nairobi, P.O. Box 29053-00625, Nairobi, Kenya.</p><p><sup>3</sup>Department of fisheries and aquaculture, University of Eldoret, P.O Box 1125-30100, Eldoret, Kenya. </p><p><sup>4</sup>School of Biological Sciences, University of Nairobi, P. O Box 30197-00100, Nairobi, Kenya.</p><p> The natural population of Nile tilapia (<em>Oreochromis niloticus</em>) is under threat from aquaculture activities due to species introgression and associated genetic drift resulting in reduced genetic strength. This reduces resilience and fitness of the natural populations upon interbreeding with the cultured stock. Inference of population structure and diversity will identify the good strains for the development of aquaculture and conservation. The study evaluated the genetic diversity and structure of Nile tilapia, <em>Oreochromis niloticus </em>germplasm<em> </em>from selected water bodies and hatcheries across the country. Microsatellite markers and gel electrophoresis platform was used to undertake molecular genetic sequencing.  The average number of alleles per locus ranged from 3.59 to 7.89 and was not significantly different between wild populations and farmed stocks. The genetic information from the study  has the potential to support the conservation of the species as well as supporting <a href="https://www.sciencedirect.com/topics/biochemistry-genetics-and-molecular-biology/selective-breeding">selective breeding</a> to improve the indigenous strains for sustainable and profitable aquaculture production. It will also be important in formulating management policies and frameworks for the establishment of aquaculture systems and best practices.</p><p> </p><p>Key words:</p><p><em>Aquaculture, conservation, Nile tilapia, genetics </em></p>',
