    path: 'dox/Sustainable Fisheries and Aquaculture/ORAL/comparative reproductive performance of three artemia franciscana populations under different salini.pdf',
    content:
      '<p><strong>Comparative reproductive performance of three <em>Artemia franciscana </em>populations under different salinity levels</strong></p><p>Sheban Hinzano<sup>1</sup>, Morine Ngarari<sup>1,2</sup>, Mary Opiyo<sup>3</sup>, Derick Rugendo<sup>1</sup>, David Midumbi<sup>1</sup>, Betty Nyonje<sup>1</sup></p><p><sup>1</sup> Kenya Marine and Fisheries Research Institute, Mombasa Research Centre, P.O Box 81651-80100, Mombasa, Kenya</p><p><sup>2 </sup>Karatina University, P.O Box 1957-10101, Karatina, Kenya</p><p><sup>3</sup> Kenya Marine and Fisheries Research Institute, Sagana Aquaculture Research Centre, P.O Box 451-10230, Sagana, Kenya</p><p>Kenya has an adapted <em>Artemia</em> population in most of the commercial saltworks following inoculation with <em>Artemia franciscana</em> from San Francisco Bay, USA in the early 1980s. However, information on the biological performance of the Kenyan <em>Artemia</em> population is very limited. The study compared the reproductive performance of the Kenyan<em> Artemia</em> population (KEN) with two other commercially important populations from San Francisco Bay (SFB) and Great Salt Lake (GSL), USA at different salinity levels. Ten couples from each population were paired in falcon tubes with saline water of 35, 70, 105 and 140 g/l giving a total of 120 stocked falcon tubes. The <em>Artemia</em> were fed with the microalgae <em>Tetraselmis</em> at the rate of 1.5 × 10<sup>6</sup> cells/animal/day. Water exchange, feeding and assessment of spawning success were done every morning.  For every successful spawn, nauplii and cysts were counted under a microscope. The data shows that the number of nauplii produced was highest at 105 g/l salinity for the KEN, 140 g/l for the SFB and 35 g/l for the GSL populations. The number of cysts produced was highest f9or the GSL and SFB populations at 105 g/l, and 140 g/l for the KEN population.  SFB population had the longest reproductive period at 140 g/l salinity while the KEN and GSL has the longest reproductive period at 105 g/l salinity. It was concluded that an increase in salinity prolongs the reproductive period of the Artemia populations. Further, the three populations had different ideal salinity levels for optimal reproductive performance. Similar studies assessing other biological attributes of the Kenyan <em>Artemia</em> population were recommended to enhance productivity and better management of the local <em>Artemia</em> population. </p>',
