    title:
      'Managing the Lake Victoria Fishery; A Driver Pressure State Impact Response (DPSIR) Framework approach',
    author: 'Priscilla Boera',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'priscillaboera@gmail.com',
    presentation_mode: 'Oral',
