    path: 'dox/Sustainable Fisheries and Aquaculture/ORAL/management of transboundary river basins_ a case study of the mara  by boera p_n_1_ jembe_ tsuma2 gi.pdf',
    content:
      '<p><strong>Management of transboundary River Basins, A case study of the Mara</strong></p><p>By Boera P.N.<sup>1</sup>, Jembe, Tsuma<sup>2</sup> Gichuki, J.<sup>3</sup> Babu Jared1, and Waithaka E.4.</p><p><sup>1</sup> KMFRI, po. Box 1881, Kisumu, <sup>2</sup> KMFRI P. O. Box 81651, Mombasa, <sup>3</sup>. Big Valley Rancheria, San Fransisco Bay Area, USA, <sup>4</sup>. KMFRI, P. O. Box Naivasha</p><p>The Mara river basin covers a trans-boundary area of 25,000 km<sup>2 </sup>on the border of Tanzania and Kenya, and consists of Masai Mara National Reserve (MMNR), part of the Serengeti National Park (SNP) and adjacent game reserves. It is a biodiversity power house and is a categorized UNESCO World Heritage Site famous for tourism. The basin provides important ecosystem services to wildlife and the communities of ~1.5 million people. It has diverse land use patterns that have resulted in various threats including deforestation, human-wildlife conflict, declining water quality and quantity, pollution due to unregulated waste water discharges, inadequate coordination of natural resource planning and management, infrastructure development and climate variability. In this paper, we assess community based natural resources management strategies employed in the Basin, through an inventory and SWOT analysis and document best practices. A purposive, cross-sectional approach designed to integrate both quantitative and qualitative data sources was used. The field survey sample size was determined according to Wonnacot and Wonnacot (1990). Focus was on CBNRM groups as a unit of analysis in three major sectors of water, wildlife, and forestry. Rapid field surveys were conducted in Mara and Serengeti using a structured questionnaire, predetermined Focus Group Discussion (FGD) question guide while the Snowball approach was used to identify LIPs or Community Resource Persons (CORPs) to be interviewed. Additionally, a SWOT analysis of the activities was conducted on the groups. A total of 79 CBNRM groups were assessed in the sectors of water, forestry, Ecotourism, wildlife and mining.  34% of these were in the Serengeti Ecosystem while 66% were in the Maasai Mara. The SWOT highlighted several issues that were used to document best practices and improve management of the basin.</p>',
