    content:
      '<p><strong>The developed Lake Victoria, Kenya marine spatial plan in relation to aquaculture suitability</strong></p><p>Christopher Mulanda Aura<sup>1* </sup>Lucy Kimani<sup>2</sup>, Chrisphine S. Nyamweya<sup>1</sup>, Jane Fonda Awour<sup>1</sup>, Venny Mziri<sup>1</sup>, Collins Ongore<sup>1</sup>, James Keyombe Last<sup>1</sup>, James M. Njiru<sup>2</sup></p><p><sup>1</sup><em>Kenya Marine and Fisheries Research Institute P.O. Box 1881-40100, Kisumu, Kenya.</em></p><p><em><sup>2</sup>Gatsby Africa, Nairobi, Kenya.</em></p><p><sup>3</sup><em>Kenya Marine and Fisheries Research Institute P.O. Box 81651-80100, Mombasa, Kenya.</em></p><p>*Corresponding author: Dr. Christopher Mulanda Aura, Email: <a href="mailto:auramulanda@yahoo.com">auramulanda@yahoo.com</a> or <a href="mailto:aura.mulanda@gmail.com">aura.mulanda@gmail.com</a> Tel.: +254711233774.</p><p><strong>Submission to: ARBEC II</strong>, June 17-20, 2024, Kisumu, Kenya.</p><p><strong>Sub-theme:</strong> Blue Economy Policies and Governance </p><p><strong>Abstract</strong></p><p>The Lake Victoria Marine Spatial Plan in relation to Aquaculture Suitability under the Sustainable Activities in Water Areas (SAWA) project is a state of the art and world class decision-making tool-oriented research and management project focused on the Kenyan portion of Lake Victoria. SAWA project intends to build, in partnership with Kenyan governance stakeholders, an evolving aquaculture governance framework that improves decision-making and addresses challenges of multiple lakes uses such as areas with resource competition. The plan delineates the lake into inshore and offshore aquaculture. The inshore cage suitable areas optimally range at a depth of about 6 – 10 m for cage culture alongside constraints like navigation routes, water hyacinth hot spots and breeding areas. The area recommended for inshore aquaculture in the lake is 291 km<sup>2</sup> representing 8% of the lake. The “not suitable” and “less suitable” areas are recommended for accessing the lake for transport, navigation, capture fisheries, tourism, sports and other lake uses. The recommended inshore aquaculture zones are potential areas for small scale farmers with low capital requirements. The offshore suitable areas that optimally ranges at an optimum depth of about 10 – 50 m for cage culture are alongside constraints like navigation routes, water hyacinth hot spots, and breeding areas. Such installations require firm anchorage to withstand strong currents and could be mainly for capital intensive farms. These sites will be suitable for commercial aquaculture and large-scale farms/firms. It is suggested that the “highly suitable” potential portion of the lake is utilized for cage culture depending on requests from investors after which more room can be sought for “suitable areas” of the lake depending on the existing production carrying capacity. Just like inshore cage farming suitability, the other “not suitable” and “less suitable” areas are recommended for accessing the lake during transport, navigation, capture fisheries, tourism and sports.</p><p><strong>Keywords: </strong>Spatial plan;<strong> </strong>Aquaculture;<strong> </strong>frameworks; Lake Victoria; sustainability.</p>',
