    path: 'dox/Technology and Innovation in the Blue Economy/ORAL/growing of seaweed under long line floating method in the kenyan coast  _justus wakili omundi1.pdf',
    content:
      '<p><strong>Growing of seaweed under long line floating method in the Kenyan Coast</strong></p><p>*Justus Wakili Omundi<sup>1</sup></p><p><sup>1</sup>Kenya Marine and Fisheries Research Institute, P. O. Box …, Mtonga, Kenya.</p><p><a href="mailto:*jwakili@gmail.com"><strong>*jwakili@gmail.com</strong></a></p><p><strong>Oral Presentation</strong></p><p><strong>Abstract</strong></p><p><a id="_heading=h.gjdgxs"></a>Globally, natural resources have been exploited to the maximum and some are being depleted due to increased human population. This has called for the need for alternative livelihoods to sustain the human population.  This study set out to assess the use of the long line floating method as an alternative to the commonly used methods in seaweed farming in the Kenyan Coast.  The study was carried out in Takaungu in Kilifi County where three methods were tested. Two species of seaweeds were tested (<em>K. Alverazii and E. denticulatum</em>). Off bottom line method and stone method were used as the control. Seaweeds were attached to rope tied on two ends for long line floating and off bottom methods while the seedlings were attached on a stone for the stone method. Each method had three plots replicated three times. The seedlings were weighed before attached/tied and monitoring was done after every two weeks up to the fifth week when they were harvested. Data was presented as means (±SE) in the form of pie charts, tables and graphs. All the analysis was done in the Excel 2010 Programme and all inferences were accepted at p&lt;0.05. From the results, no growth rate was recorded under the off bottom and stone methods due to unfriendly weather patterns. Long line floating method recorded good yields because the seaweed grew to the desirable size (weight of between 400±2.1-1000±1.8g). In conclusion, long line floating method can be the best alternative method of seaweed farming along the Kenyan coastline especially in deep waters hence I recommend it for adoption and scale up. </p><p><strong>Key words</strong>: Sustainable livelihoods, Blue economy, Seaweeds, North coast, mariculture</p>',
