    content:
      '<p><strong>Drowning Risks Among Fishers on Lake Victoria: The Interplay of Extreme Weather and Preventable Factors</strong></p><p>Horace Owiti Onyango*<sup>d,c</sup>, Ranaivo A. Rasolofoson<sup>a,b</sup>, Fonda Jane Awuor<sup>d</sup>, Christopher Aura Mulanda<sup>d</sup>, Hezron Awandu<sup>d</sup>, Patrick Otuo Wanguche<sup>d</sup>,<strong> </strong>Pamela Olela<sup>d</sup>, Erick Odari<sup>d</sup>, Nathan Kemei<sup>d</sup><strong> , </strong>Jacob Ochiewo<sup>e</sup>, Kathryn J. Fiorella<sup>a</sup></p><p>*Corresponding author E-mail: howiti@kmfri.go.ke</p><p><sup>a</sup>Department of Public and Ecosystem Health, Cornell University, Ithaca NY, USA</p><p><sup>b</sup>Duke University Marine Laboratory, Nicholas School of the Environment, Duke University, Beaufort NC, USA</p><p><sup>c</sup> Department of Natural Resources and Environment, Cornell University, Ithaca NY, USA</p><p><sup>d</sup>Kenya Marine and Fisheries Research Institute, P.O. Box 1881-40100, Kisumu, Kenya.</p><p><sup>e</sup>Kenya Marine and Fisheries Research Institute, P.O. Box 81651-80100 Mombasa, Kenya</p><p><strong>Abstract</strong></p><p>This study examines how extreme weather events and other risk factors contribute to drowning deaths among small-scale fishers on Lake Victoria, Kenya. The research employed a mixed-methods approach, combining a verbal autopsy survey (n=141) with interviews of stakeholders (n=51) conducted between September and October 2021. Data was collected from relatives or colleagues of deceased fishers at 43 landing sites around the lake, focusing on drowning incidents that occurred in the preceding year (July 2020 - June 2021). The findings reveal that nearly all drowning victims were male, with an average age of 33. Most had basic education and belonged to households of around five people. Almost half (41.84%) of the drowning incidents involved bad weather conditions, with rough water, strong winds, and heavy rain being the most frequent contributing factors. Disturbingly, the study identified a lack of essential safety measures. Life jackets or buoys were absent in over 64% of incidents, and navigation/communication equipment was missing in over 70% of cases. Poor boat maintenance was a factor in only 5.67% of drownings overall, but it rarely co-occurred with bad weather (5.08%). However, other risk factors frequently coincided with bad weather events. This included lack of swimming ability, un-motorized boats, and "not using a life jacket" - which was present in 69.49% of bad weather-related drownings. Alcohol and drug use were also identified as co-occurring factors in some cases (22.09%). The study highlights the importance of addressing multiple risk factors alongside extreme weather events, which are expected to worsen with climate change. Implementing regulations, enforcing safety measures, and raising awareness campaigns could significantly reduce drowning deaths among fishers on Lake Victoria.</p><p><strong>Keywords:</strong> Lake Victoria, Kenya, Fishers, unintentional drowning, neglected tropical disease, injury, occupational health</p>',
