    path: 'dox/Technology and Innovation in the Blue Economy/POSTER/title_ towards remote sensing of floating litter in waterways_ rivers and lakes   author_ shungu gar.pdf',
    content:
      '<p><strong>Title: </strong>Towards remote sensing of floating litter in waterways, rivers and lakes<strong> </strong></p><p><strong>Author: </strong>Shungu Garaba, Uni Oldenburg, Germany</p><p><strong>Theme: </strong>Technology and Innovation in the Blue Economy</p><p><strong>Abstract: </strong>The blue and green planet have been facing an increasing threat from mismanaged litter. In most cases the aggregated litter is composed of natural and anthropogenic items with a large portion being plastic-based objects. Efforts to remove and recycle the anthropogenic items are among the key strategies to mitigate the environmental challenges of litter of course one solution has been indicated to be a major reduction in the production of plastic-based materials. To this end, informed decisions on effective strategies related to the mismanaged litter monitoring tools are important. We present an algorithm that demonstrate capabilities of remote sensing of aggregated litter with relevant applications towards operational (i) Detection – the test for the absence or presence, (ii) Identification – distinguishing the polymer source, (iii) Quantification – estimating the abundance in an providing surface area coverage that could be statistically correlated to the weight of harvested material from a hotspot and (iv) Tracking – observing the pathways or changes in size of the patch. The algorithm detection and quantification capabilities were tested using fine pixel (&lt; 4 m) resolution satellite observations over the international Drina River. The imagery used consisted of 4 to 8 wavebands. Transferability of the algorithm including the adaption will also be presented using examples from other geographic locations in Guatemala and Slovakia.</p>',
