    content:
      '<p><strong>Aquaculture and its Conservation Potential of Critically Endangered Jipe Tilapia (<em>Oreochromis jipe</em>) in Lake Jipe</strong></p><p><strong>Paul S. Orina <sup>1*</sup>, Sheban Hinzano<sup>3</sup>, Domitila Kyule <sup>2</sup> Abwao Jacob<sup>2</sup>, Cecilia M. Githukia<sup>1</sup> and Tonny Orina<sup>4</sup>, Mercy Chepkirui<sup>1, 5</sup></strong></p><ol><li>Kenya Marine and Fisheries Research Institute, Kegati Aquaculture Centre, P.O. Box 3259-40200, Kisii, Kenya</li><li>Kenya Marine and Fisheries Research Institute, Sagana Aquaculture Centre, P. O. Box 451- 10230, Sagana, Kenya.</li><li>Kenya Marine and Fisheries Research Institute, Mombasa Research Centre, P. Box 81651-80100, Mombasa, Kenya</li><li>Faculty of Agriculture, Department of Animal Sciences, Jomo Kenyatta University of Agriculture and Technology, Nairobi, Kenya </li><li>Kisii University, Department of Fisheries and Aquatic Sciences, P. O Box 408-40200, Kisii, Kenya</li></ol><p><strong>Abstract</strong></p><p>Tilapia jipe (<em>Oreochromis jipe) </em>is listed as critically endangered cichlidae endemic to fast shrinking Lake Jipe. Climate change and anthropogenic activities have significantly impacted the lakes ecology and species genetic integrity. Four months Jipe tilapia culture growth performance was conducted in four selected farms within Chala area, Taveta Sub-County of Taita Taveta County along the slopes of Mt. Kilimanjaro’s Kenya side. The study assessed the growth performance of 3<sup>rd</sup> generation mixed sex <em>Oreochromis jipe</em> under aquaculture conditions. Fish sampling was done monthly to assess the growth performance of fingerlings stocked at an average weight of 5±0.02g and a stocking density of 5/m<sup>3</sup>. Total weight ranged between 123.72g, and 74.70g from the entire growth trial sample population. The highest and the least mean weight gains recorded were 108.87±4.31g and 87.12±4.40g for Farm B and D respectively. Similarly farm B recorded the highest mean length (18.80±0.27) while farm C recorded the least (17.31±0.25) with no significance difference between the selected farms. Water quality parameters were within the normal acceptable tilapia culture ranges. The study findings indicated a negative allometric growth (b˂3) for all farms except Farm A. All growth trials demonstrated a good Condition factor (K) with a range of 1.82 to 2.19. The present study concluded that <em>O. jipe</em> has potential for aquaculture and species genetic conservation and restocking due to its ease of propagation. The study recommends further G x E breeding programme strategies, nutritional and general management studies and a policy limiting genetic material transfer from its catchment.</p><p><strong>Key words:</strong> Conservation, Aquaculture, Potential, Policy, Jipe tilapia</p>',
