      '<p><strong>A review on heavy metals (As, Pb, Hg, Ag, and Cd) uptake by aquatic macrophytes and microbes through phytoremediation and zooremediation</strong></p><p>Authors:*Geofrey Alila<strong><sup>1</sup></strong>, Dennis Otieno<strong><sup>1</sup></strong>, and Evans Abich<strong><sup>1</sup></strong>, </p><p><strong><em><sup>1</sup></em></strong><em>Kenya Marine and Fisheries Research Institute, Kisumu Research Station, P.O. Box 1881, Kisumu</em></p><p>*Corresponding author:<a href="mailto:Chrisdennis445@gmail.com"><em>alilageofrey@gmail.com</em></a></p><p><strong>ABSTRACT</strong></p><p>Phytoremediation and zooremediation technologies use living plants and animals to clean up soil, air, and contaminated water. One of the most significant categories of environmental contaminants is heavy metals from the industrialization, population burst, and changing lifestyles which have resulted in the genesis of pollutants languishing the environment and human health. This paper aims at providing information on the efficiency of phytoremediation and zooremediation technologies in the removal of heavy metals in source water and further provides the shortcomings and strengths of using phytoremediation and zooremediation in water treatment. Approaches such as bioremediation in the elimination of heavy metals are documented, this paper uses existing data from laboratory reports, published and unpublished documents on heavy metals and further engages different search engines such as google scholar, Sematic scholar and Specialized Research networks to search and retrieve the information relevant to this review paper. The results shows that phytoremediation and zooremediation is very efficient in the removal and clearing hazardous heavy metals and the technologies have a very detailed strengths; <a id="_Hlk121454636"></a>being ecofriendly, affordable, economical, and efficient technique in the aquatic ecosystem. In the conclusion aquatic microphytes and microbes can be used to extract or stabilize heavy metal in the aquatic ecosystem.</p><p>Keywords: Phytoremediation, Zooremediation, Heavy metals, Pollutants, Aquatic microphytes, Microbes.</p>',
