    title:
      'Quantification of Post-Harvest losses for Catfish (Clarias gariepinus) Fishery in Lake Baringo t to advise management',
    author: 'Cyprian Odoli',
    country: 'Kenya',
    organization: 'KMFRI',
    email: 'codoli@kmfri.go.ke',
    presentation_mode: 'Oral',
    recommendation: 'Oral',
