    content:
      '<p>COMPARISON OF THE SHELF LIFE OF SOFT SMOKED AND DRY SMOKED MACKEREL AT REFRIGERATED AND AMBIENT TEMPERATURE: THE CASE OF LIBERIA</p><p>Victor Nah</p><p>National Fisheries and Aquaculture Authority (NaFAA)</p><p>P.O.BOX  9010 1000 Monrovia 10 Liberia</p><p>Nah.v@yahoo.com</p><p>Supervisors:</p><p>Franklin Georgsson: franklin@matis.is</p><p>Ásbjörn Jónsson: asbjorn@matis.is</p><p>ABSTRACT</p><p>The research has assessed the microbiological effect on soft smoked and dried smoked </p><p>mackerel (Scomber scombrus) using wood dry heat in keeping the quality of the fish. The </p><p>mackerel was smoked 8 hours using the Cabin kiln for both soft smoked and dried smoked </p><p>samples. Later, it was placed on rack for some minutes to cool off, after which the dry </p><p>smoked sample was packed in Gunny sack, and soft smoked packed in polypropylene </p><p>(plastic) and left on shelf for about two weeks (14 days) at ambient temperature and </p><p>refrigerated temperature. The overall research showed that the dried smoked mackerel packed </p><p>in the Gunny Sack has performed relatively well than those packed in Plastic. As regard to </p><p>temperature, the results have shown that products stored at ambient temperature had less </p><p>performance or provided huge growth in the formation of colony compared to the product </p><p>Kept at 0-4.</p>',
