    title:
      'Molecular Mechanisms Regulating Follicular Atresia In European Hakes (<I>Merluccius Merluccius</I>) And Thicklip Grey Mullets (<I>Chelon Labrosus</I>) From The Southern Bay Of Biscay',
    author: 'Anthony Nzioka',
    country: 'Spain',
    organization:
      'Research Centre for Experimental Marine Biology and Biotechnology (PiEΓÇôUPV/EHU)',
    email: 'nzioka.mutua@gmail.com',
    presentation_mode: 'Oral',
    recommendation: 'Oral',
    status: 'Sent',
    path: 'dox/Sustainable Fisheries and Aquaculture/ORAL/molecular mechanisms regulating follicular atresia in european hakes _merluccius merluccius_ and thi.pdf',
    content:
      '<p><strong>Molecular mechanisms regulating follicular atresia in European hakes (<em>Merluccius merluccius</em>)<em> </em>and thicklip grey mullets (<em>Chelon labrosus</em>) from the southern Bay of Biscay</strong></p><p><strong>Anthony Nzioka<sup>1</sup>,</strong> Ainara Valencia<strong><sup>1</sup></strong>, Iratxe Rojo-Bartolomé<strong><sup>1</sup></strong>, Aitor Atxaerandio-Landa<strong><sup>1</sup></strong>, Xabier Lekube<strong><sup>1</sup></strong>, Oihane Diaz de Cerio<strong><sup>1</sup></strong>, ﻿Mohammad Amzad Hossain<strong><sup>1</sup></strong>, Maria Korta<strong><sup>2</sup></strong>, Maren Ortiz-Zarragoitia<strong><sup>1</sup></strong>, Ibon Cancio<strong><sup>1</sup></strong></p><p><strong>﻿</strong><em><sup>1</sup>CBET Research Group, Dept. Zoology &amp; Animal Cell Biology, Faculty of Science &amp; Technology and Research Centre for Experimental Marine Biology and Biotechnology (PiE–UPV/EHU), University of the Basque Country (UPV/EHU), Areatza Hiribidea s/n, 48620, Plentzia, Basque Country, Spain</em></p><p><em><sup>2</sup>AZTI-Tecnalia, Herrera Kaia, Portualdea z/g, 20110, Pasaia, Basque Country, Spain</em></p><p>Follicular atresia is a complex degenerative process of the ovarian follicles involving the processes of apoptosis and autophagocytosis essential for the maintenance of ovarian homeostasis in teleost fish. This study investigated the molecular and cellular mechanisms involved in follicular atresia as a possible result of environmental alterations in biotic and abiotic factors in European hakes <em>Merluccius merluccius</em> that show episodes of increased follicular atresia throughout the reproductive cycle and in thicklip grey mullets <em>Chelon labrosus </em>inhabiting xenoestrogen-contaminated estuaries. Ovaries from 169 hake individuals and 31 mullets collected from the southern Bay of Biscay were analysed using histological and molecular techniques. In the European hake, different levels of atresia were detected in 74% of ovaries, with TUNEL assay identifying apoptosis in all ovarian follicles. In mullets, histopathological analysis revealed a high prevalence of atresia (up to 100%) was observed. Transcriptional profiles of apoptosis and autophagy marker genes (<em>p53, mdm2, rpl5, caspa</em>se<em>-3, and beclin-1</em>) revealed no significant differences between ovaries with atretic and non-atretic follicles in mullets, while <em>p53, caspase-3</em>, <em>ctsd </em>and <em>dapk1</em> were upregulated hake atretic vitellogenic follicles, suggesting that vitellogenesis is the moment at which both apoptosis and autophagy are at their highest during atresia. In hake, autophagy marker genes <em>beclin-1 </em>and <em>ptenb</em> were upregulated in all atretic follicles irrespective of developmental stage.<em> </em>Immunoblot analysis revealed higher expression levels of MDM2 and RPL11 in hake atretic vitellogenic follicles, with RPL11 being downregulated and P53 overexpressed in mullet atretic previtellogenic follicles. The analysed genes could provide early warning biomarkers to identify follicular atresia in fish and evaluate fecundity in fish stocks. However, the molecular mechanisms regulating atresia in both hake and mullet appear to work differently and thus it is not possible to apply the same atresia markers for both species. </p><p><strong>Keywords: </strong><em>Apoptosis; Autophagy; Biomarker; European hake; Follicular atresia; mRNA; Mullets; Reproductive cycle</em></p>',
