    path: 'dox/Marine Biology and Ecology/POSTER/remote sensing-based diachronic analysis of changes in land covers and hydrographic network in the l.pdf',
    content:
      "<p><strong>Remote sensing-based diachronic analysis of changes in land covers and hydrographic network in the landscape of the Ruzizi watershed (D.R. Congo)</strong></p><p><strong>Bararunyeretse Prudence<sup>1</sup>, Balangaliza K. Clément<sup>1, 2</sup>, Balezi Ziharirwa Alphonse<sup>3</sup>, Ntiharirizwa Seconde<sup>1</sup>  </strong></p><p><strong><sup>1 </sup>Université du Burundi, <sup>2</sup> Institut Supérieur Pédagogique de Bukavu, <sup>3 </sup>Université Officielle de Bukavu</strong></p><p>The Rusizi watershed is an important reservoir of biodiversity and water that plays a vital role in maintaining the ecological balance and biodiversity of Lake Tanganyika. However, knowledge of its potential, ecological dynamics, and threats that may serve for its sustainable management and that of Lake Tanganyika is still scarce. This work contributes to the discovery of the Ruzizi Basin, Eastern R.D. Congo, its hydrographic network, and changes in land cover from 1990 to 2021 through field observation, interviews, and space remote sensing. Numeric Field models, level curves, altitudes, and slopes on a Quick Map Services background, and the watershed contours were plotted and digitized. Landsat images serves generating maps and histograms of land use. Transition matrices for land use classes are produced.  </p><p>A total of 36 major tributaries and 2000 sub-tributaries of the Ruzizi River were identified, including 21 rivers and their tributaries that have remained poorly known. Frequent bushfires in the hills and mountains of this landscape may seriously affect this river system. From 1990 to 2021, the main noted changes include a remarkable increase in the natural forest-covered area, a declining trend in plantations and savannahs (from 28.78% to 22.26%), minor changes in the surface area occupied by fields and crops, a tripling of wetlands area, a remarkable progression of swamps (from 1.92% to 6.6%), a sufficient decline of water and an increased of the surface area occupied by bare soils and habitats. </p><p>The observed worrying changes from 2002 to 2011(i.e., Natural forest's surface area decline, and increasing plantation of eucalyptus and Cypress, wetlands decreasing trend) improved slightly in 2021, probably due to changes in anthropogenic pressure. Eco-balanced measures are needed to promote the maintenance and restoration of this large basin (about 2374 Km2), whose water flows to Lake Tanganyika.  </p><p><strong>KEY WORDS</strong>: Ruzizi watershed, Lake Tanganyika, diachronic study, land cover, remote sensing </p>",
