    content:
      '<p>Electronic Monitoring: Pilot Study for Industrial Marine Fisheries in Kenya</p><p>Edward Kimani<sup>1</sup>, George Maina<sup>2</sup>, Ana Nadal<sup>3</sup>, Collins Ndoro<sup>4</sup>, Benedict Kiilu<sup>4</sup>, Esther Fondo<sup>1</sup>, Donald Obiero<sup>4</sup>, Joan Kawaka<sup>2</sup>, Josh Wiersma<sup>5</sup>, Christi Smith<sup>6</sup>, Eric Thuranira<sup>4</sup>, Elizabeth Mueni<sup>4</sup>, Gladys Okemwa<sup>1</sup>, Jared Agano<sup>7</sup>, Jannet Mungata<sup>1</sup></p><p>1.Kenya Marine and Fisheries Research Institute, P. O. Box 81651, Mombasa, Kenya</p><p>2. The Nature Conservancy, Africa Regional Office, P.O. BOX 19738-00100, GPO, Nairobi, Kenya</p><p>3. The Nature Conservancy, The Nature Conservancy 42 San Mateo, Rancho Santa Margarita, California       92688 USA</p><p>4. Kenya Fisheries Service P.O. Box 90423-80100, Mombasa, Kenya</p><p>5. Josh Wiersma<sup>5</sup>, Integrated Monitoring Inc. One Lincoln, Boston, Massachusetts 02111 USA.</p><p>6. A.I.S., Inc., Electronic Monitoring Program Manager, 1545 NJ-37, #9, Toms River, NJ, 08755, USA.</p><p>7. Kenya Fisheries Service P.O. BOX 48511, Nairobi 00100 </p><p>Abstract</p><p>The development of marine industrial fisheries is a key element of the Blue Economy advancement in Kenya. Sustainable fisheries need reliable data and information on what happens on-the-water for science-based management. Fisheries data is conventionally obtained by self-reporting or logbooks, as well as onboard fisheries observers, both vulnerable to manipulation and loss of records.  Remote Electronic Monitoring (EM) using onboard video cameras, and GPS sensors to record real time fishing activities is regarded as a cost-effective way of automatically tracking and verify fishing activity on fishing vessels. A pilot EM study targeting four vessels is being implemented to develop a program design and determine the requirements including costs, infrastructure and human capacity for 100% application in industrial vessels. EM equipment has been installed in three vessels and the results including fishing grounds, operations and catch data from a longline vessel obtained. The EM data for eight trips, spanning 82 days is compared to observer data collected during 41 days from the same vessel. Of the seventy-four haul events observed from EM, 46 hauls were fully reviewed encompassing 14,930 hook deployments. Twenty-one different species of retained species were recorded, dominated by swordfish (78%), yellowfin tuna (3%), Barracuda (3%) silky shark (3%) and Oceanic blue shark (2%). From forty-five hauls recorded by the fisheries observers, 30 species were retained comprising Sword fish (64.4), Silky shark (8.7), Oceanic blue shark (6.2), Great barracuda (3.6), Oceanic white tip shark (3.3), Snake mackerel (2.0), and Skipjack tuna (1.7). The fisheries observers’ and EM data including the composition of the retained and discarded catch, size data as well as the requirements for both programs including equipment, infrastructure, and human capacity are compared towards improving monitoring of industrial fisheries. </p><p>Key words: electronic monitoring, fisheries observers, Industrial fishery, Kenya</p><p> </p>',
